INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000011', 'Adequate Yearly Progress Status', 'AYP Status', 'An indication of whether the state, district, or school met the Adequate Yearly Progress (AYP) requirements for the school year, as determined by the state-established criteria.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11011', '7', 11011 ); 
