INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000029', 'Assessment Type', null, 'The category of an assessment based on format and content.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11029', '7', 11029 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000030', 'Available Carnegie Unit Credit', null, 'Measured in Carnegie units, the amount of credit available to a student who successfully meets the objectives of the course. A course meeting every day for one period of the school day over the span of a school year offers one Carnegie unit. A Carnegie unit is thus a measure of seat time rather than a measure of attainment of the course objectives.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11030', '7', 11030 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000031', 'Awaiting Initial IDEA Evaluation Status', null, 'Awaiting initial evaluation for special education programs and related services under the Individuals with Disabilities Education Act (IDEA). ', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11031', '7', 11031 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000032', 'Staff Compensation Base Salary', null, 'The salary or wage a person is paid before deductions (excluding differentials) but including annuities.', 'Numeric - up to 2 digits after decimal place', FALSE, 'For the Common Core Data Teacher Compensation Survey this is: ''The negotiated annual salary for teaching duties for the school year. The base salary excludes pay for additional duties, such as supervising or directing afterschool activities, school administration activities, and teaching summer school or adult education classes. Bonuses and other incentives are not included in base salaries.''  Also use CEDS element Salary For Teaching Assignment Only Indicator to indicate if a Base Salary is specific to teaching assignments.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11032', '7', 11032 ); 
