INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000056', 'Course Code System', null, 'A system that is used to identify the organization of subject matter and related learning experiences provided for the instruction of students.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11056', '7', 11056 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000057', 'Course Credit Units', null, 'The type of credit (unit, semester, or quarter) associated with the credit hours earned for the course. ', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11057', '7', 11057 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000058', 'Credit Value', null, 'The amount of credit available to the student who successfully meets the objectives of the course or learning opportunity based on the units defined by Credit Unit Type.', 'Numeric - up to 2 digits after decimal place', FALSE, 'For K-12 a course meeting every day for one period of the school day over the span of a school year typically offers one Carnegie unit. In this case a Carnegie unit is  a measure of seat time rather than a measure of attainment of the course objectives.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11058', '7', 11058 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000059', 'Course End Date', null, 'The year, month and day an instance of a course ends.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11059', '7', 11059 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000060', 'Course Grade Point Average Applicability', 'Course GPA Applicability', 'An indicator of whether or not this course being described is included in the computation of the student?s Grade Point Average (GPA).', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11060', '7', 11060 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000061', 'Course Level Characteristic', null, 'An indication of the general nature and difficulty of instruction provided throughout a course.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11061', '7', 11061 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000063', 'Course Override School', null, 'The school where the credit was earned if different from the institution reporting. ', 'Alphanumeric - 80 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11063', '7', 11063 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000064', 'Course Quality Points Earned', null, 'The numerical value assigned to a letter grade to provide a basis of quantitative determination of an average. ', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11064', '7', 11064 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000065', 'Course Repeat Code', null, 'Indicates that an academic course has been repeated by a student and how that repeat is to be computed in the student''s academic grade average.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11065', '7', 11065 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000066', 'Course Subject Abbreviation', null, 'The alphabetic abbreviation of the academic department or discipline offering the course. It is one part of the total course identifier number. ', 'Alphanumeric - 10 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11066', '7', 11066 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000067', 'Course Title', null, 'The descriptive name given to a course of study offered in a school or other institution or organization. In departmentalized classes at the elementary, secondary, and postsecondary levels (and for staff development activities), this refers to the name by which a course is identified (e.g., American History, English III). For elementary and other non-departmentalized classes, it refers to any portion of the instruction for which a grade or report is assigned (e.g., reading, composition, spelling, and language arts).', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11067', '7', 11067 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000068', 'Postsecondary Course Title', null, 'The name or title of the course taken by a student at an academic institution.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11068', '7', 11068 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000069', 'Credential Expiration Date', null, 'The year, month and day on which an active credential held by a person will expire.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11069', '7', 11069 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000070', 'Credential Issuance Date', null, 'The year, month and day on which an active credential was issued to a person.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11070', '7', 11070 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000071', 'Credential Type', null, 'An indication of the category of credential a person holds.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11071', '7', 11071 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000072', 'Credit Unit Type', null, 'The type of credits or units of value awarded for the completion of a course.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11072', '7', 11072 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000073', 'Credits Attempted Cumulative', null, 'The cumulative number of credits a person attempts to earn by taking courses during his or her enrollment in the current school as well as those credits transferred from schools in which the person had been previously enrolled.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11073', '7', 11073 ); 
