INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000075', 'Career and Technical Education Graduation Rate Inclusion', 'CTE Graduation Rate Inclusion', 'An indication of how CTE concentrators are included in the state''s computation of its graduation rate.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11075', '7', 11075 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000076', 'Attendance Status', null, 'The status of a person''s attendance associated with an Attendance Event Type and Attendance Event Date in an organization-person-role context.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11076', '7', 11076 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000077', 'Degree Applicability', null, 'An indication that the course is a part of a degree program. ', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11077', '7', 11077 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000078', 'Degree or Certificate Seeking Student', null, 'Person is enrolled in courses for credit and recognized by the institution as seeking a degree, certificate, or other formal award. High school students also enrolled in postsecondary courses for credit are not considered degree/certificate-seeking.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11078', '7', 11078 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000079', 'Dependency Status', null, 'A person''s classification as dependent or independent with regards to eligibility for Title IV Federal Student aid.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11079', '7', 11079 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000080', 'Desegregation Order or Plan', null, 'An indication whether the LEA is covered by a desegregation plan either ordered by a court or entered into with the Office for Civil Rights under Title VI of the Civil Rights Act of 1964.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11080', '7', 11080 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000081', 'Diploma or Credential Award Date', null, 'The month and year on which the diploma/credential is awarded to a student in recognition of his/her completion of the curricular requirements.', 'YYYY-MM', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11081', '7', 11081 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000082', 'Disciplinary Action End Date', null, 'The year, month and day on which a discipline action ends.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11082', '7', 11082 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000083', 'Disciplinary Action Start Date', null, 'The year, month and day on which a discipline action begins.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11083', '7', 11083 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000084', 'Career-Technical-Adult Education Displaced Homemaker Indicator', 'CTE-AE Displaced Homemaker Indicator', 'A person who ; (A) (i) has worked primarily without remuneration to care for a home and family, and for that reason has diminished marketable skills;    (ii) has been dependent on the income of another family member but is no longer supported by that income; or    (iii) is a parent whose youngest dependent child will become ineligible to receive assistance under part A of title IV of the Social Security Act (42 U.S.C. 601 et seq.) not later than 2 years after the date on which the parent applies for assistance under such title; and (B)   is unemployed or underemployed and is experiencing difficulty in obtaining or upgrading employment.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11084', '7', 11084 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000085', 'Dual Credit Dual Enrollment Credits Awarded', null, 'The number of credits awarded a student by the postsecondary institution based on successful completion of dual credit/dual enrollment courses. ', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11085', '7', 11085 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000086', 'Economic Disadvantage Status', null, 'An indication that the student met the State criteria for classification as having an economic disadvantage.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11086', '7', 11086 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000087', 'K12 Staff Classification', null, 'The titles of employment, official status, or rank of education staff.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11087', '7', 11087 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000088', 'Electronic Mail Address', 'Email Address', 'The numbers, letters, and symbols used to identify an electronic mail (e-mail) user within the network to which the person or organization belongs.', 'Alphanumeric - between 7 and 128 characters', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11088', '7', 11088 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000089', 'Electronic Mail Address Type', 'Email Address Type', 'The type of electronic mail (e-mail) address listed for a person or organization.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11089', '7', 11089 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000091', 'Elementary-Middle Additional Indicator Status', null, ' An indication of whether the school or district met the Elementary/_Middle Additional Indicator requirement in accordance with state definition for the purpose of determining Adequate Yearly Progress (AYP).', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11091', '7', 11091 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000092', 'Eligibility Status for School Food Service Programs', null, 'An indication of a student''s level of eligibility to participate in the National School Lunch Program for breakfast, lunch, snack, supper, and milk programs.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11092', '7', 11092 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000093', 'End of Term Status', null, 'The nature of the student''s progress at the end of a given school term.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11093', '7', 11093 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000094', 'Enrollment Status', null, 'An indication as to whether a student''s name was, is, or will be officially registered on the roll of a school or schools.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11094', '7', 11094 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000095', 'Postsecondary Enrollment Type', null, 'An indicator of the enrollment type associated with the enrollment award level of a person at the beginning of a term.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11095', '7', 11095 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000096', 'Postsecondary Enrollment Status', null, 'An indication of the student''s enrollment status for a particular term as defined by the institution', null, TRUE, 'Either use option 02 or one of the options, 04 or 05, for less than full-time but at least half-time.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11096', '7', 11096 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000097', 'Enrollment Entry Date', null, 'The month, day, and year on which a person enters and begins to receive instructional services in a school, institution, program, or class-section during a given session.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11097', '7', 11097 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000098', 'Entry Date into Postsecondary', null, 'The year, month and day on which a person entered and began to receive instructional services at a postsecondary institution for the first time after completing high school (or its equivalent). ', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11098', '7', 11098 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000099', 'Entry Type', null, 'The process by which a student enters a school during a given academic session.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11099', '7', 11099 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000100', 'Entry Grade Level', null, 'The grade level or primary instructional level at which a student enters and receives services in a school or an educational institution during a given academic session.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11100', '7', 11100 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000101', 'Course Section Time Required For Completion', null, 'The actual or estimated number of clock minutes required for course completion. This number is especially important for career and technical education course and may represent (in minutes) the clock hour requirement of the course, the number of minutes (or clock hours) of class time per week, times the number of equivalent weeks the class typically meets.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11101', '7', 11101 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000102', 'Staff Evaluation Outcome', null, 'The result of an assessment of a person''s performance.', 'Alphanumeric - 80 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11102', '7', 11102 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000103', 'Staff Evaluation Scale', null, 'The quantitative or qualitative range of possible scores/rating for a person''s performance (e.g., 0 - 10; Poor, Fair, Average, Good, Excellent).', 'Alphanumeric - 80 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11103', '7', 11103 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000104', 'Staff Evaluation Score or Rating', null, 'The actual quantitative or qualitative assessment of a person''s performance.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11104', '7', 11104 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000105', 'Staff Evaluation System', null, 'The instrument and/or set of procedures with which a person''s performance is assessed.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11105', '7', 11105 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000106', 'Cohort Exclusion', null, 'Those persons who may be removed (deleted) from a cohort (or subcohort). For the Graduation Rates and Fall Enrollment retention rate reporting, persons may be removed from a cohort if they left the institution for one of the following reasons: death or total and permanent disability; service in the armed forces (including those called to active duty); service with a foreign aid service of the federal government, such as the Peace Corps; or service on official church missions.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11106', '7', 11106 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000107', 'Enrollment Exit Date', null, 'The year, month and day on which the student officially withdrew or graduated, i.e. the date on which the student''s enrollment ended.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11107', '7', 11107 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000108', 'Exit or Withdrawal Status', null, 'An indication as to whether an instance of student exit/withdrawal is considered to be of a permanent or temporary nature.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11108', '7', 11108 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000110', 'Exit or Withdrawal Type', null, 'The circumstances under which the student exited from membership in an educational institution. ', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11110', '7', 11110 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000111', 'Federal School Code', null, ' A unique code assigned by the U.S. Department of Education to schools participating in the Title IV Federal Student Aid programs.  Persons enter these codes in the Free Application for Federal Student Aid (FAFSA) to indicate which postsecondary schools they want to receive their financial aid application results.', 'Alphanumeric - exactly 6 characters in length', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11111', '7', 11111 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000112', 'Financial Aid Award Amount', null, 'The amount of financial aid awarded to a person for the term/year.', 'Numeric - up to 2 digits after decimal place', FALSE, 'Linked to financial aid award type.   &lt;BR/&gt;_Note:  For any given individual this cluster of fields may be repeated multiple times.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11112', '7', 11112 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000113', 'Financial Aid Award Type', null, 'The classification of financial aid awarded to a person for the academic term/year.', null, TRUE, 'Linked to financial aid type.&lt;BR/&gt;_Note:  For any given individual this cluster of fields may be repeated multiple times.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11113', '7', 11113 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000115', 'First Name', null, 'The full legal first name given to a person at birth, baptism, or through legal change.', 'Alphanumeric - 35 characters maximum', FALSE, 'Workforce Note: To collect data on workforce program participation, a data match will have to be negotiated between state agencies.  The data match makes use of name, social security number, gender and ethnicity data.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11115', '7', 11115 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000117', 'First Time Postsecondary Student', null, 'A person who has no prior postsecondary experience  attending any institution for the first time at the undergraduate level since completing high school (or its equivalent). This includes persons enrolled in academic or occupational programs. It also includes persons enrolled in the fall term who attended college for the first time in the prior summer term, and persons who entered with advanced standing (college credits earned before graduation from high school).', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11117', '7', 11117 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000118', 'Staff Full Time Equivalency', 'Staff FTE', 'The ratio between the hours of work expected in a position and the hours of work normally expected in a full-time position in the same setting.', 'Numeric - between 0 and 1, up to 2 digits', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11118', '7', 11118 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000120', 'GED Preparation Program Participation Status', null, 'An indication that a student aged 16-19 participates in a General Educational Development (GED) preparation program.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11120', '7', 11120 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000121', 'Generation Code or Suffix', null, 'An appendage, if any, used to denote a person''s generation in his family (e.g., Jr., Sr., III).', 'Alphanumeric - 10 characters maximum', FALSE, 'Workforce &lt;BR/&gt;_Note: To collect data on workforce program participation, a data match will have to be negotiated between state agencies.  The data match makes use of name, social security number, gender and ethnicity data.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11121', '7', 11121 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000122', 'Gifted and Talented Indicator', null, 'An indication that the student is participating in and served by a Gifted/_Talented program.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11122', '7', 11122 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000123', 'Grade Point Average Weighted Indicator', 'GPA Weighted Indicator', 'An indication of whether the reported GPA is weighted or unweighted.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11123', '7', 11123 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000124', 'Student Course Section Grade Earned', null, 'A final indicator of student performance in a course section as submitted by the instructor.', 'Alphanumeric - 15 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11124', '7', 11124 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000125', 'Grade Level When Course Taken', null, 'Student''s grade level at time of course.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11125', '7', 11125 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000126', 'Grade Level When Assessed', null, 'The grade or developmental level of a student when assessed.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11126', '7', 11126 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000127', 'Grade Point Average', null, 'The value of the total quality points divided by the Credit Hours for Grade Point Average. ', 'Numeric - up to 4 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11127', '7', 11127 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000128', 'Grade Point Average Cumulative', 'GPA - Cumulative', 'A measure of average performance in all courses taken by a person during his or her school career as determined for record-keeping purposes. This is obtained by dividing the total grade points received by the total number of credits attempted. This usually includes grade points received and credits attempted in his or her current school as well as those transferred from schools in which the person was previously enrolled.', 'Numeric - up to 4 digits after decimal place', FALSE, 'Related Connection; linked to Grade Point Average Weighted Indicator, High School Percentile, High School Rank, and Size of High School Graduating Class', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11128', '7', 11128 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000129', 'Grade Point Average Given Session', 'GPA - Given Session', 'A measure of average performance in all courses taken by a person during a given session. This is obtained by dividing the total grade points received by the number of credits attempted for the same session.', 'Numeric - up to 4 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11129', '7', 11129 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000130', 'Grade Points Earned Cumulative', null, 'The cumulative number of grade points a person earns by successfully completing courses or examinations during his or her enrollment in the current school as well as those transferred from schools in which the person had been previously enrolled.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11130', '7', 11130 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000131', 'Grades Offered', null, 'The specific grade or combination of grades offered by an education institution.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11131', '7', 11131 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000132', 'Graduation Rate Survey Cohort Year', null, 'The academic year in which a student entered as part of the GRS cohort.', 'YYYY', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11132', '7', 11132 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000133', 'Graduation Rate Survey Indicator', null, 'An indication of whether or not the student is in a GRS cohort; meaning the student began as a first-time, full-time, degree seeking student in the fall of a given year.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11133', '7', 11133 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000134', 'Gun Free Schools Act Reporting Status', null, 'An indication of whether the school or local education agency (LEA) submitted a Gun-Free Schools Act (GFSA) of 1994 report to the state, as defined by Title 18, Section 921.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11134', '7', 11134 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000135', 'Harassment or Bullying Policy Status', null, 'An indication of whether the education unit has adopted written policy prohibiting harassment and bullying on the basis of a civil rights law.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11135', '7', 11135 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000136', 'Staff Compensation Health Benefits', null, 'Contributions made by the school district, municipal, state, federal and other government agencies for the teacher''s or early learning provider''s health insurance, prorated to the specific school or local provider agency indicated on the record, not including contributions made by the teacher or early learning provider.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11136', '7', 11136 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000137', 'High School Course Requirement', null, 'An indication that this course credit is required for a high school diploma.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11137', '7', 11137 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000138', 'High School Diploma Type', null, 'The type of diploma/credential that is awarded to a person in recognition of his/her completion of the curricular requirements.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11138', '7', 11138 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000140', 'High School Graduation Rate Indicator Status', null, 'An indication of whether the school or district met the High School Graduation Rate requirement in accordance with state definition for the purposes of determining AYP.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11140', '7', 11140 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000141', 'Highest Level of Education Completed', null, 'The extent of formal instruction a person has received (e.g., the highest grade in school completed or its equivalent or the highest degree received).', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11141', '7', 11141 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000142', 'Highly Qualified Teacher Indicator', null, 'An indication that the teacher has been classified as highly qualified based on assignment.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11142', '7', 11142 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000143', 'Hire Date', null, 'The year, month and day on which a person was hired for a position, or consecutive positions within the same organization and job classification.', 'YYYY-MM-DD', FALSE, 'This is the Hire Date beginning consecutive employment with the current employer in the same Professional-Educational Job Classification. A person may change positions within the same organization and job classification without triggering a new hire date. For example a teacher originally hire to teach 3rd grade may be reassigned to 4th grade.  However, a change of job classifications, e.g. from teacher to principal, would trigger a new Hire Date.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11143', '7', 11143 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000144', 'Hispanic or Latino Ethnicity', null, 'An indication that the person traces his or her origin or descent to Mexico, Puerto Rico, Cuba, Central and South America, and other Spanish cultures, regardless of race.', null, TRUE, 'K12: Use cases support Yes and No as options.  &lt;BR/&gt;&lt;BR/&gt;_Postsecondary: &lt;BR/&gt;- Use cases support Yes and Not Selected as options&lt;BR/&gt;- As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11144', '7', 11144 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000146', 'Homeless Primary Nighttime Residence', null, 'The primary nighttime residence of the students at the time the students are identified as homeless.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11146', '7', 11146 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000147', 'Homeless Serviced Indicator', null, 'An indication of whether homeless children and youth were served by a Mc_Kinney-Vento program  in the state.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11147', '7', 11147 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000148', 'Homeless Unaccompanied Youth Status', null, 'An indication that homeless youths were unaccompanied by parents or legal guardians.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11148', '7', 11148 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000149', 'Homelessness Status', null, 'Children and youth who lack a fixed, regular, and adequate nighttime residence. Homeless children and youth include: 1) children and youth who are sharing the housing of other persons due to loss of housing, economic hardship, or a similar reason; are living in motels, hotels, trailer parks, or camping grounds due to the lack of alternative adequate accommodations; are living in emergency or transitional shelters; are abandoned in hospitals; or are awaiting foster care placement; 2) children and youth who have a primary nighttime residence that is a public or private place not designed for or originally used as a regular sleeping accommodation for human beings; or 3) children and youths who are living in cars, parks, public spaces, abandoned buildings, substandard housing, bus or train stations, or similar settings. 4) migratory children who qualify as homeless because the children are living in circumstances described in the above. (See Section 103 of the Mc_Kinney Act for a more detailed description of this data element).', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11149', '7', 11149 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000150', 'Honors Description', null, 'A description of the type of academic distinctions earned by or awarded to the person.', 'Alphanumeric - 80 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11150', '7', 11150 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000151', 'IDEA Indicator', null, 'A person having intellectual disability; hearing impairment, including deafness; speech or language impairment; visual impairment, including blindness; serious emotional disturbance (hereafter referred to as emotional disturbance); orthopedic impairment; autism; traumatic brain injury; developmental delay; other health impairment; specific learning disability; deaf-blindness; or multiple disabilities and who, by reason thereof, receive special education and related services under the Individuals with Disabilities Education Act (IDEA) according to an Individualized Education Program (IEP), Individual Family Service Plan (IFSP), or service plan.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11151', '7', 11151 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001067', 'Assessment Identifier', null, 'A unique number or alphanumeric code assigned to an assessment by a school, school system, a state, or other agency or entity.  This may be the publisher identifier.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11152', '7', 11152 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001068', 'Local Education Agency Identifier', 'LEA Identifier', 'A unique number or alphanumeric code assigned to a local education agency by a school system, a state, or other agency or entity.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces.  &lt;BR/&gt;&lt;BR/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11153', '7', 11153 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001069', 'School Identifier', null, 'A unique number or alphanumeric code assigned to an institution by a school, school system, a state, or other agency or entity.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11155', '7', 11155 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001070', 'Staff Member Identifier', null, 'A unique number or alphanumeric code assigned to a staff member by a school, school system, a state, registry, or other agency or entity.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11156', '7', 11156 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001071', 'Student Identifier', null, 'A unique number or alphanumeric code assigned to a student by a school, school system, a state, or other agency or entity.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11157', '7', 11157 ); 
