INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000172', 'Last or Surname', 'Last Name', 'The full legal last name borne in common by members of a family.', 'Alphanumeric - 35 characters maximum', FALSE, 'Workforce &lt;BR/&gt;_Note: To collect data on workforce program participation, a data match will have to be negotiated between state agencies.  The data match makes use of name, social security number, gender and ethnicity data.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11172', '7', 11172 ); 
