INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000175', 'Local Education Agency Supervisory Union Identification Number', 'LEA Supervisory Union Identification Number', 'The three-digit unique identifier assigned to the supervisory union by the state.  ', 'Alphanumeric - 3 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11175', '7', 11175 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000177', 'Assessment Level for Which Designed', null, 'The typical grade or combination of grade-levels, developmental levels, or age-levels for which an assessment is designed.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11177', '7', 11177 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000178', 'Level of Institution', null, 'A classification of whether a postsecondary institution''s highest level of offering is a program of 4-years or higher (4 year), 2-but-less-than 4-years (2 year), or less than 2-years.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11178', '7', 11178 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000179', 'Limited English Proficiency - Postsecondary', 'LEP - Postsecondary', 'The term individual with limited english proficiency means a secondary school student, an adult, or an out-of-school youth, who has limited ability in speaking, reading, writing, or understanding the English language AND whose native language is a language other than English; OR who lives in a family or community environment in which a language other than English is the dominant language. ', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11179', '7', 11179 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000180', 'Limited English Proficiency Status', 'LEP Status', 'Used to indicate persons (A) who are ages 3 through 21. (B) who are enrolled or preparing to enroll in an elementary school or a secondary school.\n(C ) (who are I, ii, or iii) (i) who were not born in the United States or whose native languages are languages other than English. (ii) (who are I and II) (I) who are a Native American or Alaska Native, or a native resident of the outlying areas; and \n(II) who come from an environment where languages other than English have a significant impact on their level of language proficiency. or (iii) who are migratory, whose native languages are languages other than English, and who come from an environment where languages other than English are dominant; and\n(D) whose difficulties in speaking, reading, writing, or understanding the English language may be sufficient to deny the individuals (who are denied I or ii or iii) (i) the ability to meet the state''s proficient level of achievement on state assessments described in section 1111(b)(3) (ii) the ability to successfully achieve in classrooms where the language of instruction is English; or\n(iii) the opportunity to participate fully in society.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11180', '7', 11180 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000181', 'Magnet or Special Program Emphasis School', null, 'A school that has been designed: 1) to attract students of different racial/ethnic backgrounds for the purpose of reducing, preventing, or eliminating racial isolation; and/or 2)to provide an academic or social focus on a particular theme (e.g., science/math, performing arts, gifted/talented, career academy or foreign language).', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11181', '7', 11181 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000182', 'Marking Period Name', null, 'The name or description of the marking period (e.g., fall, first marking period).', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11182', '7', 11182 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000183', 'Mid Term Mark', null, 'Indicator of student performance at the mid-point of the marking period.', 'Alphanumeric - 15 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11183', '7', 11183 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000184', 'Middle Name', null, 'A full legal middle name given to a person at birth, baptism, or through legal change.', 'Alphanumeric - 35 characters maximum', FALSE, 'Workforce &lt;BR/&gt;_Note: To collect data on workforce program participation, a data match will have to be negotiated between state agencies.  The data match makes use of name, social security number, gender and ethnicity data.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11184', '7', 11184 ); 
