INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000186', 'Migrant Education Program Services Type', 'MEP Services Type', 'The type of services received by participating migrant students in the migrant education program (MEP).', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11186', '7', 11186 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000187', 'Migrant Education Program Session Type', 'MEP Session Type', 'The time of year that a Migrant Education Program operates.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11187', '7', 11187 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000188', 'Migrant Education Program Staff Category', 'MEP Staff Category', 'Titles of employment, official status, or rank of staff working in the Migrant Education Program (MEP).', null, TRUE, 'Funded by Title I-C.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11188', '7', 11188 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000189', 'Migrant Status', null, 'Persons who are, or whose parents or spouses are, migratory agricultural workers, including migratory dairy workers, or migratory fishers, and who, in the preceding 36 months, in order to obtain, or accompany such parents or spouses, in order to obtain, temporary or seasonal employment in agricultural or fishing work (A) have moved from one LEA to another; (B) in a state that comprises a single LEA, have moved from one administrative area to another within such LEA; or (C) reside in an LEA of more than 15,000 square miles, and migrate a distance of 20 miles or more to a temporary residence to engage in a fishing activity.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11189', '7', 11189 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000190', 'Address County Name', null, 'The name of the county, parish, borough, or comparable unit (within a state) in which an address is located.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11190', '7', 11190 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000191', 'Name of Institution', null, 'The full legally accepted name of the institution.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11191', '7', 11191 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000193', 'Neglected or Delinquent Status', null, 'An indication that the student is participating in programs for neglected or delinquent students (N or D) under Title I, Part D, Subpart 1 (state agencies) of ESEA as amended by NCLB.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11193', '7', 11193 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000194', 'Neglected or Delinquent Program Type', null, 'The type of program under ESEA Title I, Part D, Subpart 1 (state programs) or Subpart 2 (LEA).', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11194', '7', 11194 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000196', 'Visa Type', null, 'An indicator of a non-US citizen''s Visa type.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11196', '7', 11196 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000197', 'Normal Length of Time for Completion', null, 'The amount of time necessary for a person to complete all requirements for a degree or certificate according to the institution''s catalog. This is typically 4 years (8 semesters or trimesters, or 12 quarters, excluding summer terms) for a bachelor''s degree in a standard term-based institution; 2 years (4 semesters or trimesters, or 6 quarters, excluding summer terms) for an associate''s degree in a standard term-based institution; and the various scheduled times for certificate programs.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11197', '7', 11197 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000198', 'Normal Length of Time for Completion Units', null, 'The unit of measurement for length of time for completion.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11198', '7', 11198 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000199', 'Number of Credits Attempted', null, 'The number of credits that a student can earn for enrolling in and completing a given course.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11199', '7', 11199 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000200', 'Number of Credits Earned', null, 'The number of credits an individual earns by the successful completion of a course.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11200', '7', 11200 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000201', 'Number of Days Absent', null, 'The number of days a person is absent when school is in session during a given reporting period.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11201', '7', 11201 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000202', 'Number of Days in Attendance', null, 'The number of days a person is present when school is in session during a given reporting period.', 'Numeric - up to 2 digits after decimal place', FALSE, 'Note: This applies to an enrollment period record.  Separate records using this element definition could capture attendance for regular enrollment, an out-of-school program or other program requiring attendance records.  CEDS now supports the detailed attendance events to capture attendance status on any given day, class period, or session.  CEDS generally doesn''t include elements for counts when it has the unit level elements to calculate the count.  However, this element has been retained to support the intended use cases, recognizing that the rules for attendance vary based on location.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11202', '7', 11202 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000203', 'Office of Postsecondary Education Identifier', 'OPEID', 'Identification number used by the U.S. Department of Education''s Office of Postsecondary Education (OPE) to identify schools that have Program Participation Agreements (PPA) so that its students are eligible to participate in Federal Student Financial Assistance programs under Title IV regulations. This is a 6-digit number followed by a 2-digit suffix used to identify branches, additional locations, and other entities that are part of the eligible institution.', 'Integer - exactly 8 digits', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11203', '7', 11203 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000204', 'Organization Name', null, 'The name of a non-person entity such as an organization, institution, agency or business.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11204', '7', 11204 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000205', 'Staff Compensation Other Benefits', null, 'All other benefits paid by the school district, municipal, state, federal, and other government agencies for the teacher or early learning provider, prorated to the specific school or local provider agency indicated on the record, not including retirement and health insurance benefits or contributions made by the teacher or early learning provider.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11205', '7', 11205 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000206', 'Other Name', null, 'Previous, alternate or other names or aliases associated with the person.', 'Alphanumeric - 40 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11206', '7', 11206 ); 
