INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000250', 'School Courses for the Exchange of Data Sequence of Course', 'SCED Sequence of Course', 'Where a specific course lies when it is part of a consecutive sequence of courses. This element should be interpreted as ''part <n> of <m> parts.''', 'Alphanumeric - 10 characters maximum', FALSE, 'For example: if a school offers 4 years of Theater, Theater 3 within this school would be indicated in the sequence elements as 3 4, denoting the 3rd part of a 4-part sequence of courses.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11250', '7', 11250 ); 
