INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000259', 'Social Security Number', 'SSN', 'The nine-digit number of identification assigned to the person by the Social Security Administration.', 'Integer - exactly 9 digits', FALSE, 'Workforce Notes: The most complete data source and most often used is the Unemployment Insurance Wage Record system in states. Data contained in the wage record are built around quarterly employer payroll information from each person in their employ. The common element that identifies each employee is the person''s social security number.  Another identifier typically included is the first three digits of the person''s last name. States that have attempted to use the latter have found it to be unreliable for matching purposes. &lt;BR/&gt;&lt;BR/&gt;_Also, to collect data on workforce program participation, a data match will have to be negotiated between state agencies.  The workforce data elements collected for workforce programs include many of the same elements defined for K12 students and postsecondary students, including gender and ethnicity.  At a minimum, reliable matches can be obtained through the use of names and social security numbers.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11259', '7', 11259 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000260', 'Special Education Exit Reason', null, 'The reason children who were in special education at the start of the reporting period were not in special education at the end of the reporting period.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11260', '7', 11260 ); 
