INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000614', 'Crisis Start Date', null, 'The year, month and day on which the crisis affected the agency. This date may not be the same as the date the crisis occurred if evacuation orders are implemented in anticipation of a crisis.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11607', '7', 11607 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000616', 'Grade Value Qualifier', null, 'The scale of equivalents, if applicable, for grades awarded as indicators of performance in schoolwork. For example, numerical equivalents for letter grades used in determining a student''s Grade Point Average (A=4, B=3, C=2, D=1 in a four-point system) or letter equivalents for percentage grades (90-100%=A, 80-90%=B, etc.)', 'Alphanumeric - 100 characters maximum', FALSE, 'A list of academic grade qualifiers is available from the Association of American Medical Colleges, 2450 N St., N.W., Washington, DC 20037', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11609', '7', 11609 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000617', 'Incident Location', null, 'Identifies where the incident occurred and whether or not it occurred on campus.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11610', '7', 11610 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000618', 'Personal Information Verification', null, 'The evidence by which a persons name, address, date of birth, etc. is confirmed.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11611', '7', 11611 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000620', 'Employment Separation Reason', null, 'The primary reason for the termination of the employment relationship.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11613', '7', 11613 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000621', 'Employment Separation Type', null, 'A designation of the type of separation occurring between a person and the organization.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11614', '7', 11614 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000622', 'Classroom Position Type', null, 'The type of position the staff member holds in the specific course section.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11615', '7', 11615 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000624', 'Leave Event Type', null, 'The type of the leave event.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11617', '7', 11617 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000625', 'Program Identifier', null, 'A unique number or alphanumeric code assigned to a program by a school, school system, a state, or other agency or entity.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11618', '7', 11618 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000626', 'Program Name', null, 'The name of the program of instruction, training, services or benefits available through federal, state, or local agencies.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11619', '7', 11619 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000627', 'Secondary Incident Behavior', null, 'Supplemental information about an incident when the primary offense is more serious in nature than alcohol or drug, etc. offenses.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11620', '7', 11620 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000630', 'Assessment Item Identifier', null, 'The identifier that uniquely identifies an assessment item.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11623', '7', 11623 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000632', 'Site Name', null, 'The full, legally accepted  name of the institution at the site level.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11625', '7', 11625 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000633', 'Early Learning Youngest Age Authorized to Serve', null, 'The youngest age of children a class/group is authorized or licensed to serve.  (Age is specified in months)', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11626', '7', 11626 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000634', 'Other Name Type', null, 'The types of previous, alternate or other names for a person.', 'Alphanumeric - 30 characters maximum', TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11627', '7', 11627 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000635', 'Neglected or Delinquent Academic Achievement Indicator', null, 'Student was served by Title I, Part D, Subpart 1 of ESEA as amended for at least 90 consecutive days during the reporting period who took both a pre- and post-test.', null, TRUE, 'The elements neglected or delinquent academic achievement indicator  and neglected or delinquent academic outcome indicator are different, although similarly worded.  &lt;BR/&gt;ED_Facts guidance: The Neglected or Delinquent Academic Achievement indicator  should only be used for Subpart 1; the  Neglected or Delinquent Academic Outcome Indicator Academic  Outcome Indicator should be used for subpart 2.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11636', '7', 11636 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000636', 'Neglected or Delinquent Academic Outcome Indicator', null, 'Student was served by Title I, Part D, Subpart 2 of ESEA as amended for at least 90 consecutive days during the reporting period who took both a pre- and post-test.', null, TRUE, 'The elements neglected or delinquent academic achievement indicator  and neglected or delinquent academic outcome indicator are different, although similarly worded.  &lt;BR/&gt;ED_Facts guidance: The Neglected or Delinquent Academic Achievement indicator  should only be used for Subpart 1; the  Neglected or Delinquent Academic Outcome Indicator Academic  Outcome Indicator should be used for subpart 2.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11638', '7', 11638 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000637', 'Responsible District Identifier', null, 'The district responsible for specific educational services and/or instruction of the student.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11639', '7', 11639 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000638', 'Responsible School Identifier', null, 'The school responsible for specific education services and/or instruction of the student.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11640', '7', 11640 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001066', 'Address Type for Organization', null, 'The type of address listed for an organization.', 'Alphanumeric - 30 characters maximum', TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11644', '7', 11644 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000645', 'Teaching Assignment Start Date', null, 'The year, month and day on which a teaching assignment begins.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11647', '7', 11647 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000646', 'Teaching Assignment End Date', null, 'The year, month and day on which a teaching assignment ends.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11648', '7', 11648 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000647', 'Teacher of Record', null, 'Staff member who has a Teacher of Record responsibility for a Class Section based upon the state''s definition of Teacher of Record.', null, TRUE, 'There is usually one Teacher of Record assignment in a Class Section except in the case of co-teaching/team-teaching.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11649', '7', 11649 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000648', 'Teaching Assignment Role', null, 'The role that the Staff Member has been assigned for a Class Section.  (A teacher may have the lead responsibility for one section and serve a supporting role for another section of the same course.)', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11650', '7', 11650 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000649', 'Teaching Assignment Contribution Percentage', null, 'A percentage used to weight the educator''s assigned responsibility for student learning in a Class Section, particularly when more than one educator is assigned to the class section.', 'Numeric - up to 3 digits before and 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11651', '7', 11651 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000650', 'Course Section Entry Type', null, 'The process by which a student enters a school (Course Section) during a given academic session.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11652', '7', 11652 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000651', 'Course Section Exit Withdrawal Date', null, 'The year, month and day of the first day after the date of a person''s last enrollment in a course section.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11653', '7', 11653 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000652', 'Course Section Exit Type', null, 'The circumstances under which the student exited from membership in a course section.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11654', '7', 11654 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000016', 'American Indian or Alaska Native', null, 'A person having origins in any of the original peoples of North and South America (including Central America), and who maintains cultural identification through tribal affiliation or community attachment.', null, TRUE, 'K12: Use cases support Yes and No as options.  &lt;BR/&gt;&lt;BR/&gt;_Postsecondary: &lt;BR/&gt;- Use cases support Yes and Not Selected as options&lt;BR/&gt;- As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11655', '7', 11655 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000020', 'Asian', null, 'A person having origins in any of the original peoples of the Far East, Southeast Asia, or the Indian Subcontinent. This area includes, for example, Cambodia, China, India, Japan, Korea, Malaysia, Pakistan, the Philippine Islands, Thailand, and Vietnam.', null, TRUE, 'K12: Use cases support Yes and No as options.  &lt;BR/&gt;&lt;BR/&gt;_Postsecondary: &lt;BR/&gt;- Use cases support Yes and Not Selected as options&lt;BR/&gt;- As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11656', '7', 11656 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000034', 'Black or African American', null, 'A person having origins in any of the black racial groups of Africa.', null, TRUE, 'K12: Use cases support Yes and No as options.  &lt;BR/&gt;&lt;BR/&gt;_Postsecondary: &lt;BR/&gt;- Use cases support Yes and Not Selected as options&lt;BR/&gt;- As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11657', '7', 11657 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000192', 'Native Hawaiian or Other Pacific Islander', null, 'A person having origins in any of the original peoples of Hawaii, Guam, Samoa, or other Pacific Islands.', null, TRUE, 'K12: Use cases support Yes and No as options.  &lt;BR/&gt;&lt;BR/&gt;_Postsecondary: &lt;BR/&gt;- Use cases support Yes and Not Selected as options&lt;BR/&gt;- As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11658', '7', 11658 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000301', 'White', null, 'A person having origins in any of the original peoples of Europe, Middle East, or North Africa.', null, TRUE, 'K12: Use cases support Yes and No as options.  &lt;BR/&gt;&lt;BR/&gt;_Postsecondary: &lt;BR/&gt;- Use cases support Yes and Not Selected as options&lt;BR/&gt;- As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11659', '7', 11659 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000653', 'Interscholastic Sports - Male Only', null, 'The number of interscholastic sports in which only male students participate.  Sports include distinct sports such as football, basketball, soccer but not intramural sports or cheerleading.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11660', '7', 11660 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000654', 'Interscholastic Sports - Female Only', null, 'The number of interscholastic sports in which only female students participate.  Sports include distinct sports such as football, basketball, soccer but not intramural sports or cheerleading.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11661', '7', 11661 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000655', 'Interscholastic Teams - Male Only', null, 'The number of interscholastic teams in which only male students participate.  Teams include each competitive level team in each sport, such as freshman team, junior varsity team, and varsity team but not intramural sports or cheerleading.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11662', '7', 11662 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000656', 'Interscholastic Teams - Female Only', null, 'The number of interscholastic teams in which only female students participate.  Teams include each competitive level team in each sport, such as freshman team, junior varsity team, and varsity team but not intramural sports or cheerleading.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11663', '7', 11663 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000657', 'Interscholastic Sport Participants - Male Only', null, 'The number of male students who participated on an interscholastic team.  A student should be counted once for each team he was on.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11664', '7', 11664 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000658', 'Interscholastic Sport Participants - Female Only', null, 'The number of female students who participated on an interscholastic team.  A student should be counted once for each team she was on.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11665', '7', 11665 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000689', 'Competency Framework Item Identifier', 'Learning Standard Item Identifier', 'The globally unique identifier (GUID) issued by the publisher of the competency framework that uniquely identifies the item in the hierarchy of competency framework items using a RFC 4122 compliant 32-character hexadecimal string, such as 21_EC2020-3_AEA-1069-A2_DD-08002_B30309_D.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces.  &lt;BR/&gt;&lt;BR/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11666', '7', 11666 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000690', 'Competency Framework Item Statement', 'Learning Standard Item Statement', 'The text of the statement. The textual content that either describes a specific competency or describes a less granular group of competencies within the taxonomy of the competency framework.', 'Alphanumeric', FALSE, 'Note: This element is designed to support statements from various learning standards frameworks. The Head Start Child Outcomes Framework includes statements for Domains, Elements, and Indicators. Examples from the K-12 Common Core State Standards are the domain: ?_Geometry", the cluster: ?_Understand and apply the Pythagorean Theorem,? and standard:  ?_Apply the Pythagorean Theorem to determine unknown side lengths in right triangles in real-world and mathematical problems in two and three dimensions.?', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11667', '7', 11667 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000691', 'Competency Framework Item Type', 'Learning Standard Item Type', 'The textual label identifying the class of the statement as designated by the promulgating body?e.g., standard, benchmark, strand, or topic. or level 1, level 2,...', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11668', '7', 11668 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000692', 'Competency Framework Item Code', 'Learning Standard Item Code', 'A human-referenceable code designated by the publisher to identify the item in the hierarchy of competency framework items.', 'Alphanumeric - 30 characters maximum', FALSE, 'For example: m.1.n.3  The code is usually not globally unique and usually has embedded meaning such as a number that represents a grade/level and letters that represent content strands.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11669', '7', 11669 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000693', 'Competency Framework Identifier URI', 'Learning Standard Document Identifier URI', 'An unambiguous reference to the competency framework using a network-resolvable URI.', 'Alphanumeric - 512 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11670', '7', 11670 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000694', 'Competency Framework Title', 'Learning Standard Document Title', 'The name of the competency framework.', 'Alphanumeric - 120 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11671', '7', 11671 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000695', 'Competency Framework Version', 'Learning Standard Document Version', 'Defines the revision of the competency framework as a version number or date.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11672', '7', 11672 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000696', 'Competency Framework Creator', 'Learning Standard Document Creator', 'The person or organization chiefly responsible for the intellectual content of the competency framework.', 'Alphanumeric - 120 characters maximum', FALSE, 'Implementations may choose to model this element as a repeatable field to support the case of multiple authors.  Others may just use a comma delimited string for multiple authors.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11673', '7', 11673 ); 
