INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000698', 'Competency Framework Publication Status', 'Learning Standard Document Publication Status', 'The publication status of the competency framework.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11675', '7', 11675 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000699', 'Competency Framework Jurisdiction', 'Learning Standard Document Jurisdiction', 'A legal, quasi-legal, organizational or institutional domain of the entity mandating the use of the statement--e.g., California.', 'Alphanumeric - 120 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11676', '7', 11676 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000700', 'Competency Framework Valid Start Date', 'Learning Standard Document Valid Start Date', 'The year, month and day the competency framework was adopted by the jurisdiction in which it was intended to apply.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11677', '7', 11677 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000701', 'Competency Framework Valid End Date', 'Learning Standard Document Valid End Date', 'The year, month and day the competency framework was deprecated/replaced by the jurisdiction in which it was intended to apply.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11678', '7', 11678 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000702', 'Competency Framework Subject', 'Learning Standard Document Subject', 'The topic or academic subject of the competency framework.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11679', '7', 11679 ); 
