INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000705', 'Hearing Screening Date', null, 'The year, month and day of a hearing screening.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11681', '7', 11681 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000706', 'Dental Screening Date', null, 'The year, month and day of a dental screening', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11682', '7', 11682 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000707', 'Assessment Item Maximum Score', null, 'The maximum number of points possible for the assessment item.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11683', '7', 11683 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000708', 'Assessment Item Minimum Score', null, 'The minimum number of points possible for the assessment item.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11684', '7', 11684 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000709', 'Assessment Item Characteristic Value', null, 'A psychometric measure provided for an assessment item.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11685', '7', 11685 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000710', 'Charter School Type', null, 'The category of charter school.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11686', '7', 11686 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000711', 'Cohort Description', null, 'A description of the student cohort.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11687', '7', 11687 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000712', 'Curriculum Framework Type', null, 'An indication of the standard curriculum used for this course.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11688', '7', 11688 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000713', 'High School Diploma Distinction Type', null, 'The distinction of the diploma or credential that is awarded to a student in recognition of their completion of the curricular requirements.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11689', '7', 11689 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000714', 'Kindergarten Program Participation Type  ', null, 'The type of Kindergarten program the student is enrolled in.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11690', '7', 11690 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000715', 'Competency Framework Item Prerequisite Identifier', 'Learning Standard Item Prerequisite Identifier', 'The unique identifier of an immediate prerequisite Competency Framework Item, a competency needed prior to learning this one. (Some items may have no prerequisites others may have one or more prerequisites. This should only be used to represent the immediate predecessors in a competency-based pathway, i.e. not prerequisites of prerequisites.)', 'Alphanumeric - 40 characters maximum', FALSE, 'The recommended approach is to use the entity Learning Standard Item Association instead of this data element. Learning Standard Item Association also supports associating other entities, such as Learning Resources, to learning standard items. CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11691', '7', 11691 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000716', 'Program Sponsor Type', null, 'A type of organization providing funds for a particular educational or service program or activity or for an individual''s participation in the program or activity.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11692', '7', 11692 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000717', 'Assessment Performance Level Identifier', null, 'A unique number or alphanumeric code assigned to an assessment performance level.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11693', '7', 11693 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000718', 'Assessment Performance Level Label', null, 'A label representing the performance level appropriate for use on a report.', 'Alphanumeric - 20 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11694', '7', 11694 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000719', 'Assessment Subtest Rules', null, 'A description of the rules to produce a student test/subtest score from for a grouping of student item scores.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11695', '7', 11695 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000722', 'Address Type for Staff', null, 'The address type for a staff member.', 'Alphanumeric - 30 characters maximum', TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11698', '7', 11698 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000724', 'Assessment Item Response Score Value', null, 'The score given to a person''s response to an assessment item.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11700', '7', 11700 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000725', 'Competency Framework Item Education Level', 'Learning Standard Item Education Level', 'The education level, grade level or primary instructional level at which a Competency Framework Item is intended.', null, TRUE, 'More than one Learning Standard Grade Level may be associated with one Learning Standard Item.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11701', '7', 11701 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000726', 'Academic Year Designator', null, 'The academic year for which the data apply.', 'YYYY-YYYY', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11702', '7', 11702 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000727', 'Academic Term Designator', null, 'The academic term for which the data apply.', null, TRUE, 'Needs to be used in combination with Predominant Calendar System element in order to determine if the option set is referring to a semester, quarter, or some other term length.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11703', '7', 11703 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000728', 'Distance Education Course Enrollment', null, 'An individual''s enrollment in a course or courses in which the instructional content is delivered exclusively via distance education.  Distance education is education that uses one or more technologies to deliver instruction to students who are separated from the instructor and to support regular and substantive interaction between the students and the instructor synchronously or asynchronously.  Technologies used for instruction may include: Internet; one-way and two-way transmissions through open broadcasts, closed circuit, cable, microwave, broadband lines, fiber optics, satellite or wireless communication devices; audio conferencing; and video cassette, DV_Ds, and CD-RO_Ms, if the cassette, DV_Ds, and CD-RO_Ms are used in a course in conjunction with the technologies listed above.', null, TRUE, 'Element defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11704', '7', 11704 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000729', 'Predominant Calendar System', null, 'The method by which an institution structures most of its courses for the academic year.', null, TRUE, 'Definition and code set in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11705', '7', 11705 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000730', 'Standard Occupational Classification', null, 'A Bureau of Labor Statistics coding system for classifying occupations by work performed and, in some cases, on the skills, education and training needed to perform the work at a competent level.  See http://www.bls.gov/soc/soc_structure_2010.pdf.', '##-####', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11707', '7', 11707 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000731', 'IPEDS Occupational Category', null, 'The Integrated Postsecondary Education Data System (IPEDS) occupational categories used to report employees.', null, TRUE, 'IPEDS reporting categories beginning with the 2012 IPEDS survey year.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11708', '7', 11708 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000732', 'Instructional Staff Status', null, 'Staff whose primary function/occupational activity is primarily instruction or instruction combined with research and/or public service.  Does not include medical school staff.', null, TRUE, 'As defined in IPEDS.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11709', '7', 11709 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000733', 'Medical School Staff Status', null, 'Staff employed by or employees working in the medical school component of a postsecondary institution or in a free standing medical school.  Does not include staff employed by or employees working strictly in a hospital associated with a medical school or those who work in health or allied health schools or departments such as dentistry, veterinary medicine, nursing or dental hygiene.', null, TRUE, 'As defined in IPEDS.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11710', '7', 11710 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000734', 'Faculty Status', null, 'Persons identified by the institution as such and typically those whose initial assignments are made for the purpose of conducting instruction, research or public service as a principal activity (or activities). They may hold academic rank titles of professor, associate professor, assistant professor, instructor, lecturer or the equivalent of any of those academic ranks. Faculty may also include the chancellor/president, provost, vice provosts, deans, directors or the equivalent, as well as associate deans, assistant deans and executive officers of academic departments (chairpersons, heads or the equivalent) if their principal activity is instruction combined with research and/or public service. The designation as faculty is separate from the activities to which they may be currently assigned. For example, a newly appointed president of an institution may also be appointed as a faculty member. Graduate, instruction, and research assistants are not included in this category.', null, TRUE, 'As defined in IPEDS.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11711', '7', 11711 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000735', 'Instructional Staff Contract Length', null, 'The contracted teaching period for faculty.', null, TRUE, 'Option set new for IPEDS in 2012 survey year; IPEDS does not include the Less than 9-month code', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11712', '7', 11712 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000736', 'Full-time Status', null, 'An indication of whether an individual is employed for a standard number of hours (as determined by civil or organizational policies) in a week, month, or other period of time.', null, TRUE, 'Postsecondary: The type of appointment at the snapshot date determines whether an employee is full-time or part-time.  The employee''s term of contract is not considered in making the determination of full or part-time.  Causal employees (hired on an ad-hoc basis or occasional basis to meet short-term needs) and students in the College Work-Study Program (CWS) are not considered part-time staff.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11713', '7', 11713 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000737', 'Contract Type', null, 'The type of employment contract used by an institution.', null, TRUE, 'Option set defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11714', '7', 11714 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000738', 'Tenure System', null, 'An indicator of whether an institution has personnel positions that lead to consideration for tenure.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11715', '7', 11715 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000739', 'Instructional Staff Faculty Tenure Status', null, 'An indicator of the type of faculty status a person has if, by institutional definition, a staff member has faculty status.', null, TRUE, 'Option set defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11716', '7', 11716 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000740', 'Academic Rank', null, 'The academic rank of staff whose primary responsibility is instruction, research, and/or public service.  Institutions without standard academic ranks should code staff whose primary responsibility is instruction, research, and/or public service as no academic rank.', null, TRUE, 'Element definition and option set defined in IPEDS.  Adjunct is not included since it can be determined from a combination of the elements Instructional Staff Faculty Tenure Status and Full-time Status.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11717', '7', 11717 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000741', 'Instruction Credit Type', null, 'A designation of the type(s) of instruction being delivered by staff whose primary responsibility is instruction.  Instruction that is for credit can be applied toward the requirements for a postsecondary degree, diploma, certificate or other formal award.', null, TRUE, 'Element definition and option set defined in IPEDS; new collection element for the 2012 survey year', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11719', '7', 11719 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000742', 'Graduate Assistant Status', null, 'Graduate-level students employed on a part-time basis, not limited to, but often employed for the primary purpose of assisting in classroom or laboratory instruction or in the conduct of research.  Graduate students having titles such as graduate assistant, teaching assistant, teaching associate, teaching fellow, or research assistant typically hold these positions.', null, TRUE, 'As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11720', '7', 11720 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000743', 'Graduate Assistant IPEDS Occupation Category', null, 'The Integrated Postsecondary Education Data System (IPEDS) occupational categories used to report graduate assistants.', null, TRUE, 'Option set defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11721', '7', 11721 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000744', 'Annual Base Contractual Salary', null, 'The total annual base contractual salary of a person.', 'Integer - greater than or equal to 0', FALSE, 'As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11722', '7', 11722 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000745', 'Tuition - Published', null, 'The published tuition for first time, full-time undergraduate students (lower of in-district or in-state for public institutions).  Tuition may be charged per term, per course, per credit or per program.', 'Numeric - up to 2 digits after decimal place', FALSE, 'The tuition rate used in the calculation of the institutional net price of attendance.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11723', '7', 11723 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000746', 'Tuition Unit', null, 'The component for which tuition is being charged.  It might be a time period (term, quarter, year, etc.) or it might be an entity of education (course, credit hour, etc.).', null, TRUE, 'As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11725', '7', 11725 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000747', 'Required Student Fees', null, 'Fixed sum charged to persons for items not covered by tuition and required of such a large proportion of all students that the student who does not pay the charge is the exception.', 'Numeric - up to 2 digits after decimal place', FALSE, 'As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11726', '7', 11726 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000748', 'Institutionally Controlled Housing Status', null, 'An indication of whether an institution has any residence hall or housing facility located on- or off-campus that is owned or controlled by an institution and used by the institution in direct support of or in a manner related to, the institution''s educational purposes.', null, TRUE, 'As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11727', '7', 11727 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000749', 'Room Charges', null, 'The charges for an academic year for rooming accommodations for a typical student sharing a room with one other student.', 'Numeric - up to 2 digits after decimal place', FALSE, 'As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11728', '7', 11728 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000750', 'Board Charges', null, 'The charges assessed students for an academic year for the maximum meal plan available.', 'Numeric - up to 2 digits after decimal place', FALSE, 'As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11729', '7', 11729 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000751', 'Books and Supplies Costs', null, 'The average cost for books and supplies for a typical student for an entire academic year (or program). Does not include unusual costs for special groups of students (e.g., engineering or art majors) unless they constitute the majority of students at an institution.', 'Numeric - up to 2 digits after decimal place', FALSE, 'As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11730', '7', 11730 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000752', 'Other Student Expenses', null, 'The amount of money (estimated by the financial aid office) needed by a person to cover expenses such as laundry, transportation, and entertainment.', 'Numeric - up to 2 digits after decimal place', FALSE, 'As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11731', '7', 11731 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000753', 'Price of Attendance', null, 'The total amount institutions estimate that undergraduate-level full-time, first-time degree-seeking students will pay to attend before financial aid is considered. This price includes tuition and fees, books and supplies, room and board, and certain other designated expenses such as transportation. These estimates are the average amounts used by the financial aid office to determine a student?s financial aid.', 'Numeric - up to 2 digits after decimal place', FALSE, 'As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11732', '7', 11732 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000754', 'Comprehensive Fee', null, 'A single fixed amount of money charged by an institution that covers tuition, required fees, room, and board. For some institutions, this amount may also cover books and supplies.', 'Numeric - up to 2 digits after decimal place', FALSE, 'As defined in IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11733', '7', 11733 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000755', 'Postsecondary Applicant', null, 'An individual who has fulfilled the institution?s requirements to be considered for admission (including payment or waiving of the application fee, if any) and who has been notified of one of the following actions: admission, nonadmission, placement on waiting list, or application withdrawn (by applicant or institution). Include early decision, early action, and students who began studies during summer in this cohort.', null, TRUE, 'CDS definition/instructions; first part matches IPEDS', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11735', '7', 11735 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000756', 'Admitted Student', null, 'Applicant who has been granted an official offer to enroll in a postsecondary institution. Admitted applicants should include wait-listed students who were subsequently offered admission.', null, TRUE, 'First sentence from IPEDS, not CDS; Second sentence from CDS instructions.  All options except no should be able to be collapsed into yes for IPEDS reporting.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11736', '7', 11736 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000757', 'Wait Listed Student', null, 'A person who meets the admission requirements but will only be offered a place in the class if space becomes available.', null, TRUE, 'Common Data Set definition', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11738', '7', 11738 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000758', 'Grade Point Average Domain', 'GPA Domain', 'The domain to which the Grade Point Average is referencing.', null, TRUE, 'Used to indicate to which academic domain a grade point element is referencing', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11739', '7', 11739 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000759', 'High School Percentile', null, 'The High School Rank divided by the Size of High School Graduating Class expressed as a percentage.', 'Numeric - up to 3 digits before and 2 digits after decimal place', FALSE, 'Related Connection; linked to High School Grade Point Average Cumulative, Grade Point Average Weighted Indicator, High School Rank, and Size of High School Graduating Class&lt;BR/&gt;0% to 99% (where 99% corresponds to the valedictorian, 0% to the bottom rank in the class)', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11740', '7', 11740 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000760', 'Postsecondary Student Housing On-Campus', null, 'The student resides in a residence hall or housing facility owned or controlled by an institution within the same reasonably contiguous geographic area and used by the institution in direct support of or in a manner related to, the institution''s educational purposes.', null, TRUE, 'IPEDS Definition', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11741', '7', 11741 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000761', 'Fraternity Participation Status', null, 'Student is in membership of a chiefly social organization of men students at a college or university, usually designated by Greek letters.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11743', '7', 11743 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000762', 'Sorority Participation Status', null, 'Student is in membership in a chiefly social organization of women students at a college or university, usually designated by Greek letters.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11744', '7', 11744 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000763', 'Financial Aid Applicant', null, 'Any applicant who submits any one of the institutionally required financial aid applications/forms, such as the  Free Application for Federal Student Aid (FAFSA).', null, TRUE, 'Common Data Set definition.&lt;br/&gt;_Element should be used in combination with Financial Aid Applicant Type.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11745', '7', 11745 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000765', 'Financial Need', null, 'The amount of financial need as determined by an institution using the federal methodology and/or your institution''s own standards.', 'Numeric - up to 2 digits after decimal place', FALSE, 'Common Data Set definition', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11747', '7', 11747 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000766', 'Teacher Education Test Company', null, 'The name of the company that provides the examination used in the teacher education program.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11748', '7', 11748 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000767', 'Teacher Preparation Program Enrollment Status', null, 'An indication of whether a person is pursuing certification as a teacher.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11749', '7', 11749 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000768', 'Teacher Preparation Program Completer Status', null, 'An indication of whether a person completed a state-approved teacher preparation program.  The fact that a person has or has not been recommended to the state for initial certification or licensure may not be used as a criterion for determining who is a program completer.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11750', '7', 11750 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000769', 'Alternative Route to Certification or Licensure', null, 'An indication of whether a person is enrolled in an alternative teacher preparation program as defined by Title II.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11751', '7', 11751 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000770', 'Critical Teacher Shortage Area Candidate', null, 'An indication of whether a person is pursuing licensure/certification in a field designated as a shortage area as defined by Title II.', null, TRUE, 'When used in conjunction with the element Classification of Instructional Program, the field of study can be determined.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11753', '7', 11753 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000771', 'Supervised Clinical Experience', null, 'An indication of whether a person is enrolled in a supervised clinical experience (including student teaching) as part of a teacher preparation program.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11754', '7', 11754 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000772', 'Supervised Clinical Experience Clock Hours', null, 'An indication of  the number of clock hours (minimum) a student is required to complete associated with a supervised clinical experience.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11755', '7', 11755 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000773', 'Teacher Education Credential Exam Type', null, 'The type of examination used to assess teacher candidate''s knowledge and skills.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11756', '7', 11756 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000774', 'Teacher Education Credential Exam Score Type', null, 'An indication of the type of credential exam associated with a given exam score.', 'Alphanumeric - 30 characters maximum', FALSE, 'Praxis I: &lt;BR/&gt;_Reading&lt;BR/&gt;_Mathematics&lt;BR/&gt;_Writing&lt;BR/&gt;&lt;BR/&gt;_Praxis II:&lt;BR/&gt;_Codes at http://www.ets.org/praxis/about/praxisii/content&lt;BR/&gt;&lt;BR/&gt;ACTFL codes at http://www.languagetesting.com/', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11757', '7', 11757 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000775', 'Low-income Status', null, 'A person who receives or is a member of a family who receives a total family income in the 6 months prior to enrollment of 70 percent of the income standard for a family of that size or that does not exceed the poverty line, or the person is receiving or is a member of a family who is receiving cash assistance payments from Federal, State, or local agencies or food stamps, or the person can be designated as homeless under the Mc_Kinney Act.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11758', '7', 11758 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000776', 'Dislocated Worker Status', null, 'An individual who has been terminated or laid off, or who has received a notice of termination or layoff from employment, or an individual who was self-employed but is unemployed as a result of general economic conditions in the community in which the individual resides or because of natural disasters.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11759', '7', 11759 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000777', 'Public Assistance Status', null, 'A person who receives financial assistance from Federal, State, or local government agencies, including Temporary Assistance for Needy Families or equivalent.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11760', '7', 11760 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000778', 'Rural Residency Status', null, 'A person who resides in a place with a population of less than 2,500 that is not near any metropolitan area with a population greater than 50,000, or in a city with adjacent areas of high density.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11761', '7', 11761 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000779', 'Adult Educational Functioning Level at Intake', null, 'An individual''s entering skill level, as defined by the National Reporting System for Adult Education and determined by an approved standardized assessment at program intake.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11763', '7', 11763 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000780', 'Adult Educational Functioning Level at Posttest', null, 'An individual''s skill level, as defined by the National Reporting System for Adult Education and determined by an approved standardized assessment after a set time period or number of instructional hours.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11764', '7', 11764 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001077', 'Adult Education Instructional Program Type', null, 'The type of instructional program in which an adult is enrolled.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11765', '7', 11765 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000782', 'Adult Education Special Program Type', null, 'The type, by location or delivery mode, of adult education instruction program in which an adult participates.', null, TRUE, 'Also see Adult Education Instructional Program Type', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11766', '7', 11766 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001079', 'Goals for Attending Adult Education', null, 'A person''s reasons for attending an adult education class or program.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11767', '7', 11767 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000784', 'Adult Education Postsecondary Transition Action', null, 'The action taken with respect to postsecondary enrollment by the learner after program exit or when co-enrolled in ABE and postsecondary with respect to enrollment in a postsecondary educational or occupational skills program building on prior services or training received.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11768', '7', 11768 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001081', 'Adult Education Postsecondary Transition Date', null, 'The year, month and day on which a person previously enrolled in adult education entered and began to receive instructional services or training at a postsecondary institution.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11769', '7', 11769 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000786', 'Adult Education Staff Classification', null, 'The titles of employment, official status, or rank of adult education staff.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11770', '7', 11770 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001083', 'Adult Education Staff Employment Status', null, 'The condition under which a person has agreed to serve as an employee.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11771', '7', 11771 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000788', 'Years of Prior Adult Education Teaching Experience', null, 'The total number of years that a person has previously held a teaching position in one or more adult education programs.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11774', '7', 11774 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001085', 'Adult Education Certification Type', null, 'An indication of the category of certification a person holds.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11775', '7', 11775 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000790', 'Proxy Contact Hours', null, 'The number of instructional hours completed by an adult enrolled in a distance learning program.', 'Numeric - up to 1 digit after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11776', '7', 11776 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001076', 'Adult Education Service Provider Identifier', null, 'A unique number or alphanumeric code assigned to an institution by a school, school system, a state, or other agency or entity.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11777', '7', 11777 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000781', 'Adult Education Service Provider Identification System', null, 'A coding scheme that is used for identification and record-keeping purposes by schools, social services, or other agencies to refer to an institution.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11778', '7', 11778 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001078', 'Adult Education Provider Type', null, 'The type of institution responsible for providing adult education instructional services.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11779', '7', 11779 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000783', 'Professional or Technical Credential Conferred', null, 'An indicator of the category of credential conferred by a state occupational licensing entity or industry organization for competency in a specific area measured by a set of pre-established standards.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11780', '7', 11780 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001080', 'Child Identifier', null, 'A unique number or alphanumeric code assigned to a child by a school, school system, a state, or other agency or entity.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11781', '7', 11781 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000785', 'Child Identification System', null, 'A coding scheme that is used for identification and record-keeping purposes by programs, schools, social services, or other agencies to refer to a child.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11782', '7', 11782 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000787', 'Family Identifier', null, 'A unique number or alphanumeric code assigned to a family by a school, school system, a state, or other agency or entity.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11784', '7', 11784 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000789', 'Early Childhood Degree or Certificate Holder', null, 'Staff has a degree in early childhood regardless of level.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11786', '7', 11786 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001086', 'Total Approved Early Childhood Credits Earned', null, 'Total semester credits earned in early childhood regardless of whether credits are earned as part of an early childhood degree program, other degree program or outside of a degree program.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11787', '7', 11787 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000792', 'Early Learning Staff Total College Credits Earned', null, 'Total number of college credits earned, including all credits within a degree and outside a degree, regardless of whether they all are early childhood credits.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11791', '7', 11791 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000793', 'Staff Education Entry Date', null, 'The year, month and day that a staff member began participating in an educational experience (course, educational program, or formal education activity).', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11792', '7', 11792 ); 
