INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000862', 'Economic Research Service Rural-Urban Continuum Code', 'ERS Rural-Urban Continuum Code', 'Rural-Urban Continuum Codes form a classification scheme that distinguishes metropolitan (metro) counties by the population size of their metro area, and nonmetropolitan (nonmetro) counties by degree of urbanization and adjacency to a metro area or areas. The metro and nonmetro categories have been subdivided into three metro and six nonmetro groupings, resulting in a nine-part county codification. The codes allow researchers working with county data to break such data into finer residential groups beyond a simple metro-nonmetro dichotomy, particularly for the analysis of trends in nonmetro areas that may be related to degree of rurality and metro proximity.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11862', '7', 11862 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000863', 'Program Follows Salary Scale', null, 'An indication of whether a program has a salary scale that is followed for practitioners', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11863', '7', 11863 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000864', 'Early Learning Program Year', null, 'The year the program is operating.', 'YYYY', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11864', '7', 11864 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000865', 'State Licensed Facility Capacity', null, 'The maximum number of children for which a state licensed a facility.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11865', '7', 11865 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000866', 'Full-Time Employee Benefits', null, 'The benefits offered by a program/facility/employer for full-time staff.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11866', '7', 11866 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000867', 'Part-Time Employee Benefits', null, 'The benefits offered by a program/facility/employer for part-time staff.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11867', '7', 11867 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000868', 'Differential Shift Pay Indicator', null, 'An indication of whether staff receive differential shift pay.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11868', '7', 11868 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000869', 'Competency Framework Item Association Type', 'Learning Standard Item Association Type', 'Defines the nature of the association between a Competency Framework Item and an associated data object such as a Learning Resource, an Assessment Item, or even another Learning Standard_Competency Framework Item.', null, TRUE, 'The Learning Standard Item Association entity defines metadata relationships between a Learning Standard Item and other objects or relationships between Learning Standard Items not otherwise defined in the normal taxonomy of the framework such as for competency-based pathways, relationships between different versions of the same learning standard, and relationships to resources. &lt;br /&gt;&lt;BR/&gt;&lt;BR/&gt;_For example, prerequisite may indicate that the Associated Learning Standard Item is a Prerequisite of this Learning Standards Item.  Another association may specify that a Learning Resource teaches the specified Learning Standard Item, or is aligned to the reading level specified as part of the Learning Standard Item.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11869', '7', 11869 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000870', 'Competency Framework Item Typical Age Range', 'Learning Standard Item Typical Age Range', 'The typical range of ages for the content?s intended end user.', 'Alphanumeric - 20 characters maximum', FALSE, 'E.g. 7-9', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11870', '7', 11870 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000871', 'Competency Framework Item Association Identifier URI', 'Learning Standard Item Association Identifier URI', 'A URI that establishes uniqueness of an association between a competency framework item and another competency framework item or other objects such as learning resources.', 'Alphanumeric - 512 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11871', '7', 11871 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000872', 'Competency Framework Item Parent Identifier', 'Learning Standard Item Parent Identifier', 'The globally unique identifier (GUID) issued by the publisher of the competency framework that uniquely identifies the parent item in the hierarchy of competency framework items using a RFC 4122 compliant 32-character hexadecimal string, such as 21_EC2020-3_AEA-1069-A2_DD-08002_B30309_D.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11872', '7', 11872 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000873', 'Competency Framework Item Parent Code', 'Learning Standard Item Parent Code', 'A human-referenceable code designated by the publisher to identify the parent item in the hierarchy of competency framework items.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11873', '7', 11873 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000874', 'Competency Framework Item URL', 'Learning Standard Item URL', 'A network-resolvable Uniform Resource Locator (URL) pointing to the authoritative reference for the competency framework item.', 'Alphanumeric - 512 characters maximum', FALSE, 'An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11874', '7', 11874 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000875', 'Competency Framework Item Blooms Taxonomy Domain', 'Learning Standard Item Blooms Taxonomy Domain', 'Classification of the Competency Framework Item using Bloom''s Taxonomy Domains.?', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11875', '7', 11875 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000876', 'Competency Framework Item Multiple Intelligence', 'Learning Standard Item Multiple Intelligence', 'Classification of the Competency Framework Item using intelligences defined for Howard Earl Gardner''s Theory of Multiple Intelligences.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11876', '7', 11876 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000877', 'Competency Set Completion Criteria', null, 'The criteria for the set of competencies that represent completion or partial completion of a unit, course, program, degree, certification, or other achievement/award. Specifies whether completion requires achievement of all items in the set or some number of items.', null, TRUE, 'The criteria may be ?all? competencies in the set or ?at-least? # of competencies. Sets may be nested, e.g. all in subset A and 3 of 5 from subset B.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11877', '7', 11877 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000878', 'Competency Set Completion Criteria Threshold', null, 'The minimum number of competencies in the set that must be achieved for completion or partial completion of a unit, course, program, degree, certification, or other achievement/award.', 'Integer - greater than or equal to 0', FALSE, 'Used to define the completion criteria when Competency Set Completion Criteria is at least.  Not used when Competency Set Completion Criteria is all.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11878', '7', 11878 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000879', 'Learning Resource Competency Alignment Type', null, 'The alignment relationship between the resource and the competency.', null, TRUE, 'A community of SEA''s have agreed to use a limited set of Learning Resource Competency Alignment Type options when tagging learning resources in shared resource repositories. Those options are assesses, teaches, and requires.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11879', '7', 11879 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000880', 'Competency Framework Language', 'Learning Standard Document Language', 'The default language of the text used for the content in the competency framework.', null, TRUE, 'The CEDS ISO 639-2 Language Code option set comes from the &lt;a href=http://www.loc.gov/standards/iso639-2/langhome.html&gt;ISO 639-2 standard&lt;/a&gt;, the character encoding in ISO 8859-1 download.  Discontinued codes from the ISO standard are not included in the CEDS list.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11880', '7', 11880 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000881', 'Competency Framework Item Language', 'Learning Standard Item Language', 'The default language of the text used for the content in the competency framework item statement.', null, TRUE, 'The CEDS ISO 639-2 Language Code option set comes from the &lt;a href=http://www.loc.gov/standards/iso639-2/langhome.html&gt;ISO 639-2 standard&lt;/a&gt;, the character encoding in ISO 8859-1 download.  Discontinued codes from the ISO standard are not included in the CEDS list.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11881', '7', 11881 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000882', 'Competency Framework License', 'Learning Standard Document License', 'A legal document giving official permission to do something with the competency framework.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11882', '7', 11882 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000883', 'Competency Framework Item License', 'Learning Standard Item License', 'The full text or URL reference to a legal document giving official permission to do something with the competency framework item statement.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11883', '7', 11883 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000884', 'Competency Framework Publisher', 'Learning Standard Document Publisher', 'The entity responsible for making the competency framework available.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11884', '7', 11884 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000885', 'Competency Framework Rights', 'Learning Standard Document Rights', 'The information about rights held in and over the resource.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11885', '7', 11885 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000886', 'Competency Framework Rights Holder', 'Learning Standard Document Rights Holder', 'The person or organization owning or managing rights over the competency framework.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11886', '7', 11886 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000887', 'Competency Framework Item Concept Keyword', 'Learning Standard Item Concept Keyword', 'The significant topicality of the competency framework item using free-text keywords and phrases.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11887', '7', 11887 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000888', 'Competency Framework Item Concept Term', 'Learning Standard Item Concept Term', 'The topicality of the competency framework item, e.g. pythagorean theorem trigonometric functions forces and energy scientific method oral history etc.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11888', '7', 11888 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000889', 'Assessment Registration Assignor Identifier', null, 'The unique identifier of the person who assigned the assessment to the learner.', 'Alphanumeric - 40 characters maximum', FALSE, 'For example, the unique identifier of a classroom teacher or school principal.&lt;BR/&gt;&lt;BR/&gt;CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;BR/&gt;&lt;BR/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11889', '7', 11889 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000890', 'Assessment Result Descriptive Feedback', null, 'The formative descriptive feedback that was given to a learner based on a scored/evaluated portion of an assessment as recorded in the result entity.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11890', '7', 11890 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000891', 'Assessment Item Response Descriptive Feedback', null, 'The formative descriptive feedback that was given to a learner in response to the results from a scored/evaluated assessment item.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11891', '7', 11891 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000892', 'Credential Category Type', null, 'The category of achievement attributed to the learner.', 'Alphanumeric - 60 characters maximum', FALSE, 'Categories could include competency mastered, competency retained, course completed, level completed, certificate earned, diploma earned, license earned, license endorsement earned, participation, academic honor, non-academic honor, etc. (This element supports an emerging use case, therefore a complete set of options are not known.  Future CEDS versions may define an Achievement Type element when a fixed option set can be compiled.)  Note: The Achievement entity is most valuable when linked to a specific competency set that defined the learning standards related to the achievement.(SEE achievement category system)', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11892', '7', 11892 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000893', 'Credential Title', null, 'The title assigned to the achievement.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11893', '7', 11893 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000894', 'Credential Image URL', null, 'The Uniform Resource Locator (URL) for the unique address of an image representing an award or badge associated with the achievement.', 'Alphanumeric - 512 characters maximum', FALSE, 'Typical use is for online display of a badge image.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11894', '7', 11894 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000895', 'Credential Description', null, 'A description of the achievement.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11895', '7', 11895 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000896', 'Credential Criteria', null, 'The criteria for competency-based completion of the achievement/award.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11896', '7', 11896 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000898', 'Credential Award Issuer Name', null, 'The name of the agent issuing the award.', 'Alphanumeric - 128 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11898', '7', 11898 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000900', 'Credential Award Issuer Origin URL', null, 'The Uniform Resource Locator (URL) from which the award was issued.', 'Alphanumeric - 512 characters maximum', FALSE, 'Used only if an award is issued electronically for the achievement.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11900', '7', 11900 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000901', 'Credential Evidence Statement', null, 'A statement or reference describing the evidence that the learner met the criteria for attainment  of the achievement.', 'Alphanumeric - 300 characters maximum', FALSE, 'A narrative that may connect multiple pieces of evidence OR an IRI or document describing the work that the recipient did to earn the achievement. This can be a page that links out to other pages if linking directly to the work is infeasible. May be used in an array of multiple values.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11901', '7', 11901 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000902', 'Goal Success Criteria', null, 'One or more statements that describes the criteria used by teachers and students to check for attainment of a goal.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11902', '7', 11902 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000903', 'Goal Description', null, 'A statement that describes the desired outcomes.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11903', '7', 11903 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000904', 'Assessment Item Possible Response Feedback Message', null, 'A message provided to the person being assessed after giving a response that matches the possible response.', 'Alphanumeric - 300 characters maximum', FALSE, 'This may be a message of affirmation for a correct answer or descriptive feedback for an incorrect answer.  For example, if the item asked the question what is 2 times 3 and the learner answered 5, the Feedback Message might be try multiplication instead of addition.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11904', '7', 11904 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000905', 'Assessment Item Possible Response Sequence Number', null, 'The position of this response in the list of responses displayed, such as for a multiple choice item type.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11905', '7', 11905 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000906', 'Assessment Item Text Complexity Value', null, 'The complexity of the text using the scaling system defined by Text Complexity System, e.g. Lexile? for assessment items with a reading passage.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11906', '7', 11906 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000907', 'Assessment Item Text Complexity System', null, 'The scaling system used to specify the text complexity of an assessment item.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11907', '7', 11907 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000908', 'Assessment Item Possible Response Value', null, 'The description of each distracter on an assessment item, explaining why it is there, what misunderstandings it exposes.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11908', '7', 11908 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000910', 'Competency Framework Item Text Complexity System', 'Learning Standard Item Text Complexity System', 'The scaling system used to specify the text complexity of a competency framework item.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11910', '7', 11910 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000911', 'Learning Resource URL', null, 'The Uniform Resource Locator where the resource may be accessed, or a proxy for the resource, such as an information page for a commercially available resource.', 'Alphanumeric - 512 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11911', '7', 11911 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000912', 'Learning Resource Title', null, 'The title of the resource.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11912', '7', 11912 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000913', 'Learning Resource Subject Name', null, 'The descriptive name for the subject of the content for the learning resource.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11913', '7', 11913 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000914', 'Learning Resource Subject Code', null, 'The code used to identify the organization of subject matter and related learning experiences addressed by the learning resource.', 'Alphanumeric - 30 characters maximum', FALSE, 'A promising practice is to use a URL as the Learning Resource Subject Code, that resolves to a web page describing a term in a subject taxonomy.  For example, for mathematics, the URL http://id.loc.gov/authorities/classification/BH301.M35.html points to the Library of Congress classification for mathematics.  For K12 curriculum sced - School Courses for the Exchange of Data (SCED) may be used, e.g. https://ceds.ed.gov/_Sced_Course_Codes.aspx#02031 is mathematics (grade 1)', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11914', '7', 11914 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000915', 'Learning Resource Subject Code System', null, 'The system that is used to identify the organization of subject matter and related learning experiences addressed by the learning resource.', 'Alphanumeric - 30 characters maximum', FALSE, 'This may be a URL to a web page describing the subject code system or a name or abbreviation for the system if no authoritative web page exists.  When the associated learning resource Subject Code is a URL, that URL usually provides enough context so that the subject code system need not be specified.  However, this may be the URL to a page describing the classification system and/or the entry point to the web hosted classification system.  E.g. for the Library of Congress Classification System use: http://id.loc.gov/authorities/classification.html', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11915', '7', 11915 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000916', 'Learning Resource Date Created', null, 'The date on which the resource was created.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11916', '7', 11916 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000917', 'Learning Resource Creator', null, 'The name of a person or organization credited with the creation of the resource.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11918', '7', 11918 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000918', 'Learning Resource Publisher Name', null, 'The name of the organization credited with publishing the resource.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11919', '7', 11919 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000919', 'Learning Resource Language', null, 'The primary language of the resource.', null, TRUE, 'The CEDS ISO 639-2 Language Code option set comes from the &lt;a href=http://www.loc.gov/standards/iso639-2/langhome.html&gt;ISO 639-2 standard&lt;/a&gt;, the character encoding in ISO 8859-1 download.  Discontinued codes from the ISO standard are not included in the CEDS list.&lt;BR/&gt;_Note: For accessible resources LRMI uses language codes from the IETF BCP 47 standard which also refers to ISO 639. (Equivalent of the Af_A language_Of_Adaptation property.)', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11920', '7', 11920 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000921', 'Learning Resource License URL', null, 'The URL where the owner specifies permissions for using the resource.', 'Alphanumeric - 512 characters maximum', FALSE, 'Ex: ?http://creativecommons.org/licenses/by/3.0/?', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11922', '7', 11922 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000922', 'Learning Resource Based On URL', null, 'A resource that was used in the creation of this resource. This term can be repeated for multiple sources.', 'Alphanumeric - 512 characters maximum', FALSE, 'Ex: ?http://example.com/great-multiplication-intro.html?', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11923', '7', 11923 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000923', 'Learning Resource Intended End User Role', null, 'The individual or group for which the resource was produced.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11924', '7', 11924 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000924', 'Learning Resource Time Required', null, 'The approximate or typical time it takes to work with or through this learning resource for the typical intended target audience.', 'HH:MM', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11925', '7', 11925 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000925', 'Learning Resource Typical Age Range Minimum', null, 'The minimum for the typical range of ages of the content?s intended end user.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11926', '7', 11926 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000926', 'Learning Resource Typical Age Range Maximum', null, 'The maximum for the typical range of ages of the content?s intended end user.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11927', '7', 11927 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000927', 'Learning Resource Interactivity Type', null, 'The predominate mode of learning supported by the learning resource. Acceptable values are active, expositive, or mixed.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11928', '7', 11928 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000928', 'Learning Resource Type', null, 'The predominate type or kind characterizing the learning resource.', null, TRUE, 'A community of SEA''s have agreed to use a limited set of Learning Resource Type options when tagging learning resources in shared resource repositories. The options defined for this element align with those common tagging specifications.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11929', '7', 11929 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000929', 'Learning Resource Text Complexity Value', null, 'The complexity of the text using the scaling system defined by Text Complexity System, e.g. Lexile(tm).', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11930', '7', 11930 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000930', 'Learning Resource Text Complexity System', null, 'The scaling system used to specify the text complexity of an Learning Resource', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11931', '7', 11931 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000931', 'Assessment Short Name', null, 'An abbreviated title for an assessment.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11932', '7', 11932 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000932', 'Assessment Family Title', null, 'The full title of the Assessment Family. An Assessment Family is a set of assessments with a common name, jurisdiction, or focus, such as Graduate Record Exam or National Assessment of Educational Progress.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11933', '7', 11933 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000933', 'Assessment Family Short Name', null, 'The abbreviated title of the Assessment Family. An Assessment Family is a set of assessments with a common name, jurisdiction, or focus.', 'Alphanumeric - 30 characters maximum', FALSE, 'Examples: SAT, GRE, NAEP', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11934', '7', 11934 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000934', 'Learner Action Type', null, 'The type of action taken by the learner.', null, TRUE, 'The CEDS Learner Action Type option set comes from the &lt;a href=https://w3id.org/xapi/adl&gt;ADL Controlled Vocabulary&lt;/a&gt;, x_API specification.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11935', '7', 11935 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000935', 'Learner Action Value', null, 'The value representing input by the learner using an online system, such as a value entered in response to an assessment question, or the URL of a learning resource link clicked.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11936', '7', 11936 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000937', 'Learner Action Date Time', null, 'The date and time at which the action was taken.', 'YYYY-MM-DDTHH:MM:SS', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11938', '7', 11938 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000938', 'Learner Activity Language', null, 'The default language used for the assignment.', null, TRUE, 'The CEDS ISO 639-2 Language Code option set comes from the &lt;a href=http://www.loc.gov/standards/iso639-2/langhome.html&gt;ISO 639-2 standard&lt;/a&gt;, the character encoding in ISO 8859-1 download.  Discontinued codes from the ISO standard are not included in the CEDS list.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11939', '7', 11939 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000939', 'Learner Activity Title', null, 'The title?for work assigned to the learner, which can comprise of learning resources, activities, and assessments.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11940', '7', 11940 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000940', 'Learner Activity Description', null, 'The description and context for the assignment  described in a way that the learner can understand.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11941', '7', 11941 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000941', 'Learner Activity Prerequisite', null, 'The description of the skills or competencies the student must have to engage in assignment.', 'Alphanumeric - 300 characters maximum', FALSE, 'Note: Prerequisites may also be referenced via an associated Learning Goal and Competency Set (prerequisites for individual competencies).  For some applications enumeration of the detailed prerequisites will have greater utility than a single descriptive field.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11942', '7', 11942 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000942', 'Learner Activity Type', null, 'The type of work assigned to the learner.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11943', '7', 11943 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000943', 'Learner Activity Creation Date', null, 'The creation date of the assignment.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11944', '7', 11944 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000944', 'Learner Activity Maximum Time Allowed', null, 'The time required to complete the assignment.', 'Integer - greater than or equal to 0', FALSE, 'Time allowed is assumed to be unlimited if zero or omitted.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11945', '7', 11945 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000945', 'Learner Activity Maximum Time Allowed Unit', null, 'The unit of time of the?_Maximum Time Allowed?value.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11946', '7', 11946 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000946', 'Learner Activity Due Date', null, 'The date assignment is due.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11947', '7', 11947 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000947', 'Learner Activity Due Time', null, 'The time the assignment is due.', 'HH:MM:SS', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11948', '7', 11948 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000948', 'Learner Activity Maximum Attempts Allowed', null, 'The number attempts a student may make on this assignment. Assumed to be unlimited if zero or omitted.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11949', '7', 11949 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000949', 'Learner Activity Add To Grade Book Flag', null, 'Identifies the assignment as one that is graded.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11950', '7', 11950 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000950', 'Learner Activity Release Date', null, 'The date the student was informed about an assignment or that an automated system displays the assignment.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11951', '7', 11951 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000951', 'Learner Activity Weight', null, 'The percentage weight of the assignment during the particular course or term.', 'Numeric - up to 3 digits before and 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11952', '7', 11952 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000952', 'Learner Activity Possible Points', null, 'The number of possible points for an assignment.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11953', '7', 11953 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000953', 'Learner Activity Rubric URL', null, 'The Uniform Resource Locator pointing to a rubric that may be used to evaluate learner performance on the assignment.', 'Alphanumeric - 512 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11954', '7', 11954 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000954', 'Assessment Item Response Scaffolding Item Flag', null, 'Indicates that the response is to a scaffolding problem rather than the main/assigned problem.  A scaffolding item is a follow-up formative assessment item used to assess prerequisite or component skills, presented immediately after a learner gives an incorrect answer on the previous item.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11955', '7', 11955 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000955', 'Assessment Item Response Hint Count', null, 'The total number of hints presented as the learner responded to a formative assessment item.  This may include hints requested by the learner or hints automatically presented such as in an online tutoring system. Presentation of a scaffolding item is a separate response record and not counted as a hint.', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11956', '7', 11956 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000956', 'Assessment Item Response Hint Included Answer', null, 'Indicates that one of the hints presented included the correct answer.', null, TRUE, 'A typical scenario for an online tutoring application may present a series of hints for a formative assessment item with the last hint being the correct answer.  The learner must enter the correct answer before continuing.  This data element is a flag that the learner was presented with the bottom hint, which is the correct answer.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11957', '7', 11957 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000957', 'Assessment Item Response First Attempt Duration', null, 'The amount of time in seconds or milliseconds that a person took to give an initial response, a first attempt to answer a formative assessment item.', 'HH:MM:SS or HH:MM:SS.sss', FALSE, 'Formative assessments often allow learners to make multiple attempts until a correct or acceptable answer is given.  In such cases it is valuable to know both the time it took for the initial response and the total time spent responding to the problem.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11958', '7', 11958 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000958', 'Assessment Item Response Start Time', null, 'The time of day that the assessment item was presented to the learner.', 'HH:MM:SS or HH:MM:SS.sss', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11959', '7', 11959 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000959', 'Assessment Item Response Start Date', null, 'The date on which the assessment item was presented to the learner.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11960', '7', 11960 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000961', 'Assessment Administration Code', null, 'The code given to the assessment event by a state or other authority directing overall administration.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11962', '7', 11962 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000962', 'Assessment Administration Start Date', null, 'The start date of the time period designated for the assessment administration.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11963', '7', 11963 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000963', 'Assessment Administration Start Time', null, 'The start time of the time period designated for the assessment administration.', 'HH:MM:SS', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11964', '7', 11964 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000964', 'Assessment Administration Finish Date', null, 'The finish date of the time period designated for the assessment administration.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11965', '7', 11965 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000965', 'Assessment Administration Finish Time', null, 'The finish time of the time period designated for the assessment administration.', 'HH:MM:SS', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11966', '7', 11966 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000966', 'Assessment Administration Organization Name', null, 'The name of the organization with overall responsibility for the assessment event.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11967', '7', 11967 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000967', 'Assessment Administration Assessment Family', null, 'The title of the assessment family to be administered.', 'Alphanumeric - 60 characters maximum', FALSE, 'A typical scenario for an assessment administration is a state-wide administration of an accountability test.  For example, in Florida florida comprehensive assessment test.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11968', '7', 11968 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000968', 'Assessment Session Security Issue', null, 'The description of a security issue, if any, discovered for an administration of an assessment, such as suspected cheating by a student or a teacher changing answers after a student takes the test.', 'Alphanumeric - 300 characters maximum', FALSE, 'For example: Suspected plagiarism ; Computer left test window ; Excessive response time ; Proctor suspected copying ; Student identity not confirmed ; No proctor present ; Student carried wireless mobile device during test ; Student terminated test early and restarted ; Excessive erasures on test form ; Response pattern identical to another student''s', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11969', '7', 11969 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000969', 'Assessment Item Response Security Issue', null, 'The description of security issue, if any, related to a learner''s response to an assessment item.', 'Alphanumeric - 300 characters maximum', FALSE, 'For example: Suspected plagiarism ; Computer left test window ; Excessive response time ; Proctor suspected copying ; Student identity not confirmed ; No proctor present ; Student carried wireless mobile device during test ; Student terminated test early and restarted ; Excessive erasures on test form ; Response pattern identical to another student''s', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11970', '7', 11970 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000970', 'Assessment Result Date Updated', null, 'The most recent date that the result was calculated/updated.  The value should be the same as Assessment Result Date Created if the subtest has only been scored once, but may be different if the score was recalculated with a different result.', 'YYYY-MM-DD', FALSE, 'This flag is to handle cases when a subtest result is originally scored using incorrect parameters and then rescored, such as if the grade level attributed to the student was originally encoded incorrectly and later corrected.  An operational system may also capture the history of if rescored more than once.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11971', '7', 11971 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000971', 'Assessment Result Date Created', null, 'The date on which the assessment result was generated.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11972', '7', 11972 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000972', 'Teacher Student Data Link Exclusion Flag', null, 'Indicates that the student is excluded from calculation of value-added or growth attribution calculations used for teacher evaluation.', null, TRUE, 'The context for this element is the intersection of a teacher assignment to a Class/_Section and a student enrollment to a Class/_Section.  It may be represented in a data model as a separate entity such as Teacher Student Data Link Exclusion.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11973', '7', 11973 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000973', 'Demographic Race Two or More Races', null, 'A person having origins in any of more than one of the racial groups.', null, TRUE, 'To support backward compatibility for systems that cannot derive this, i.e. systems that use a single race/ethnicity element rather than separate flags that can indicate one or more ethnicities.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11974', '7', 11974 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000974', 'Course Section Enrollment Status Start Date', null, 'The date on which the enrollment status began related to a student enrolled in an instance of a course.', 'YYYY-MM-DD', FALSE, 'Enrollment statuses may overlap, for example at one point in time a student may be both pre-registered and wait listed for enrollment in a course, the start dates may be different and the end dates may be the same as the start date for enrolled status when the student moves off the wait list.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11975', '7', 11975 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000975', 'Course Section Enrollment Status End Date', null, 'The date on which the enrollment status ended related to a student enrolled in an instance of a course.', 'YYYY-MM-DD', FALSE, 'Enrollment statuses may overlap, for example at one point in time a student may be both pre-registered and wait listed for enrollment in a course, the start dates may be different and the end dates may be the same as the start date for enrolled status when the student moves off the wait list.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11976', '7', 11976 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000976', 'Course Section Enrollment Status Type', null, 'The status related to a student enrollment in an instance of a course.', null, TRUE, 'Enrollment statuses may overlap, for example at one point in time a student may be both pre-registered and wait listed for enrollment in a course, the start dates may be different and the end dates may be the same as the start date for enrolled status when the student moves off the wait list.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11977', '7', 11977 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000977', 'Assessment Administration Name', null, 'The name given to an assessment event.', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11978', '7', 11978 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000978', 'Course Section Identifier', null, 'A unique number or alphanumeric code assigned by an institution, school, school system, state, or other agency or entity for a particular course-section.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11979', '7', 11979 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000979', 'Assessment Form Section Sequence Number', null, 'The position of the assessment section presented in the sequence of sections within an assessment form.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11980', '7', 11980 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000980', 'Assessment Form Section GUID', null, 'The globally unique identifier of an Assessment Form Section using a RFC 4122 compliant hexadecimal string.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS guid elements are defined as RFC 4122 compliant 32-character hexadecimal strings (36 characters with dashes). For example, 21_EC2020-3_AEA-1069-A2_DD-08002_B30309_D. &lt;br/&gt;&lt;br/&gt;_Values MAY be encoded using a hash function such as HMAC-MD5 or HMAC-SHA1, resulting in a string up to 40 characters.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11981', '7', 11981 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000981', 'Assessment GUID', null, 'The globally unique identifier of an Assessment using a RFC 4122 compliant hexadecimal string.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS guid elements are defined as RFC 4122 compliant 32-character hexadecimal strings (36 characters with dashes). For example, 21_EC2020-3_AEA-1069-A2_DD-08002_B30309_D. &lt;br/&gt;&lt;br/&gt;_Values MAY be encoded using a hash function such as HMAC-MD5 or HMAC-SHA1, resulting in a string up to 40 characters.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11982', '7', 11982 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000982', 'Accreditation Agency', null, 'The agency that accredited a program.', null, TRUE, 'Organization Name may be used with Organization Type=`Accrediting Organization` when Accreditation Agency is set to `Other Accreditation Agency.`',  'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11983', '7', 11983 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000983', 'Administrative Policy Type', null, 'A type of administrative policy used by a program.', null, TRUE, 'More than one Administrative Policy Type may apply.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11984', '7', 11984 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000984', 'Facility Licensing Status', null, 'The status of the facility license.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11985', '7', 11985 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000985', 'Session Start Time', null, 'The hour, minute and second on which a session begins.', 'HH:MM:SS', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11986', '7', 11986 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000986', 'Session End Time', null, 'The hour, minute and second on which a session ends.', 'HH:MM:SS', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11988', '7', 11988 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000987', 'Employed While Enrolled', null, 'An individual who is a paid employee or works in his or her own business, profession, or farm, as reported through the State Unemployment Insurance Wage Report, FEDES, or WRIS, and at the same time is enrolled in secondary, postsecondary, or adult education or workforce programs.', null, TRUE, 'Individual-level data obtained by matching records with wage records, FEDES, or WRIS. The State Education Agency defines the time period for this collection around an exit period and a corresponding period for employment and earnings data to be obtained. The option set includes yes for employment found via one of the resources listed in the source element. These sources won''t tell you anything further about employment or unemployment, only that a record was not found or not matched thus unknown.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11989', '7', 11989 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000988', 'Employed After Exit', null, 'An individual who is a paid employee or works in his or her own business, profession, or farm, as reported through the State Unemployment Insurance Wage Report, FEDES, or WRIS, after exiting secondary, postsecondary, or adult education or workforce programs.', null, TRUE, 'Individual-level data obtained by matching records with wage records, FEDES, or WRIS. The State Education Agency defines the time period for this collection around an exit period and a corresponding period for employment and earnings data to be obtained. The option set includes yes for employment found via one of the resources listed in the source element. These sources will provide information about most of the types of jobs that students or former students will  become employed in but not all.  For that reason when a record is not found or not matched their employment status is unknown for the targeted time base.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11990', '7', 11990 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000989', 'Quarterly Earnings', null, 'The quarterly amount paid to individuals found employed during the reference period.', 'Numeric - up to 2 digits after decimal place', FALSE, 'Workforce Notes: Quarterly earnings are the sum of all the reported earnings for each individual for all jobs held during the reference quarter. reference quarter is the period of employment defined by the agency for its purposes either for students who are enrolled or after they exit. The amount is expressed as a numeric dollar amount. Note that it may be desirable to collect these data over time, in a longitudinal sense, to measure things related to persistence and growth in employment.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11991', '7', 11991 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000990', 'Employment Location', null, 'The state or other location in which an individual is found employed.', null, TRUE, 'Workforce Notes: The most commonly available indication of where employment is located is at the state level. While federal data resources provide indicators outside of the United States, these resources will not represent the majority of the students found employed, which will be based on state UI Wage Data. There may, in some instances, be multiple states where employment is found. Note that it may be desirable to collect these data over time, in a longitudinal sense, to measure things related to persistence, change, and growth in employment.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11992', '7', 11992 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000991', 'Person Employed in Multiple Jobs Count', null, 'The number of jobs held by a person during the reference period.', 'Integer - greater than or equal to 0', FALSE, 'Workforce Notes: The data sources represent employment during a three month period. Students found employed may have multiple jobs during a reference period with no indication of their sequence. The option set provides a set of numeric ranges for these instances. Many states report these numbers, some as indications of employment stability. Note that it may be desirable to collect these data over time, in a longitudinal sense, to measure things related to persistence, change, and growth in employment.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11993', '7', 11993 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000992', 'Employment Record Reference Period Start Date', null, 'The year, month, and day of the first day of the employment record reference period.', 'YYYY-MM-DD', FALSE, 'The reference quarter is the 13-week period around which employment and earnings data are collected. For unemployment insurance purposes, quarters are defined by 13-week periods. In most state cases, a reference quarter is defined to coincide with an enrollment period (e.g., a term or semester) or as a certain number of quarters after exiting a program, such as 3d quarter after exit. In some cases, states have defined the reference quarter to represent a period where employment and earnings data are collected for all of a previous year''s exits and graduates. This is often the October- December quarter. Ultimately, the most value to be gained from the use of employment and earnings data is when data are collected continuously, both in a longitudinal sense for defined cohorts of students, as well as for an annual set of students.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11994', '7', 11994 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000993', 'Employment Record Reference Period End Date', null, 'The year, month, and day of the last day of the employment record reference period.', 'YYYY-MM-DD', FALSE, 'The reference quarter is the 13-week period around which employment and earnings data are collected. For unemployment insurance purposes, quarters are defined by 13-week periods. In most state cases, a reference quarter is defined to coincide with an enrollment period (e.g., a term or semester) or as a certain number of quarters after exiting a program, such as 3d quarter after exit. In some cases, states have defined the reference quarter to represent a period where employment and earnings data are collected for all of a previous year''s exits and graduates. This is often the October- December quarter. Ultimately, the most value to be gained from the use of employment and earnings data is when data are collected continuously, both in a longitudinal sense for defined cohorts of students, as well as for an annual set of students.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11995', '7', 11995 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000994', 'Employment Record Administrative Data Source', null, 'Administrative data source of information used to collect employment and earnings-related data.', null, TRUE, 'For over 25 years, states have relied upon administrative data sources to document the employment and earnings of students and former students. The sources listed are complementary, rather than alternatives. That is, State UI records only include information for employees within a state''s boundaries. The WRIS II system can provide employment data for other states (from their UI wage record systems). State UI records do not include information about federal or postal service employment, nor do they contain information about military enlistments. FEDES provides access to that information. Ideally, an entity will use UI, WRIS (other state UI), and FEDES together.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=11996', '7', 11996 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000997', 'Workforce Program Type', null, 'The type of workforce and employment development program that an individual is participating in.', null, TRUE, 'A reference period for identifying program participation during or after enrollment in secondary education, postsecondary education, or adult education will have to be defined by the agency in collaboration with other agency partners.  At this point this element is intended only to indicate program participation and does not delve into programmatic details, persistence, or completion.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12000', '7', 12000 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000998', 'Workforce Program Participation Start Date', null, 'The year, month, and day of the first day of the reference period during which data are matched between education and workforce data sources.', 'YYYY-MM-DD', FALSE, 'Agencies define the time period for this collection around an enrollment period or exit date with a to-be defined lag period following an exit event. Enrollment periods are defined in CEDS for K12 and postsecondary students. The term exit includes leaving education for any reason including dropping out or graduating with or without a credential. Exiting conditions are defined in CEDS for K12 and postsecondary students.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12001', '7', 12001 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '000999', 'Workforce Program Participation End Date', null, 'The year, month, and day of the last day of the reference period during which data are matched between education and workforce data sources.', 'YYYY-MM-DD', FALSE, 'Agencies define the time period for this collection around an enrollment period or exit date with a to-be defined lag period following an exit event. Enrollment periods are defined in CEDS for K12 and postsecondary students. The term exit includes leaving education for any reason including dropping out or graduating with or without a credential. Exiting conditions are defined in CEDS for K12 and postsecondary students.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12002', '7', 12002 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001000', 'Assessment Early Learning Developmental Domain', null, 'Developmental domains related to early learning and used for assessing a child''s kindergarten readiness.', null, TRUE, 'Used by states in reporting Kindergarten Entry Assessment (KEA) results as defined for some federal grant programs.&lt;BR/&gt;&lt;BR/&gt;_For each domain used by the state, the state would provide:&lt;BR/&gt;- The total number of children who participated in the KEA for each domain&lt;BR/&gt;- The number of children who participated in the KEA for each domain AND was at or above what the state defines as ?ready? for kindergarten for that domain.&lt;BR/&gt;&lt;BR/&gt;_The counts may be calculated using unit-level data defined for Assessment Subtest (scoring method and what is being measured, e.g. the Domain), related Assessment Performance Levels (e.g. ready), related to each student Assessment Result.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12003', '7', 12003 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001001', 'Special Needs Policy', null, 'Program ensures that policies are in place for  Individualized Education Programs (IE_Ps) or Individual Family Service Plans (IFS_Ps) to meet the child''s unique needs.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12004', '7', 12004 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001002', 'Learning Resource Educational Use', null, 'The purpose of the work in the context of education.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12005', '7', 12005 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001003', 'Assessment Participant Session Delivery Device Details', null, 'The details about the device or platform by with which the assessment was delivered to the learner.', 'Alphanumeric - 300 characters maximum', FALSE, 'For example web browser version and screen resolution.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12006', '7', 12006 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001004', 'Assessment Personal Needs Profile Assigned Support', null, 'Defines whether or not the individual needs the kind of support defined by the entity.', null, TRUE, 'This flag may apply to any need within the Assessment Personal Need Profile.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12007', '7', 12007 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001005', 'Assessment Personal Needs Profile Activate By Default', null, 'Determines if the alternative accessible content is rendered as the default content for the learner.', null, TRUE, 'This flag may apply to any need within the Assessment Personal Need Profile.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12008', '7', 12008 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001006', 'Assessment Provider', null, 'Identifies the provider or publisher of the assessment.', 'Alphanumeric - 30 characters maximum', FALSE, 'AIF property', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12009', '7', 12009 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001007', 'Assessment Result Preliminary Indicator', null, 'If this score is preliminary, then this attribute value should be set.  Preliminary scores may be provided for early use by the assessment program or user while final scoring is occurring.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12010', '7', 12010 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001008', 'Diagnostic Statement Source', null, 'Identifies the source of the Diagnostic Statement based on a scored/evaluated portion of an assessment.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12011', '7', 12011 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001009', 'Assessment Result Number of Responses', null, 'The number of responses that are included with the Student Score Set. Responses are those items that were attempted (partially or fully answered) by the student and not necessarily the number of items in the assessment (which can be determined from the assessment object).', 'Integer - greater than or equal to 0', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12012', '7', 12012 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001010', 'Assessment Form Subtest Item Weight Correct', null, 'A weighting factor for how the item score is used to compute a sub-test score when the item is correct or partially correct. Item weight of 1 indicates the full item score is used. A weight of .5 would indicate the item only contributes one half of the item score to the subtest. A weight of 0 indicates the item does not affect the sub test score.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12013', '7', 12013 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001012', 'Assessment Form Subtest Item Weight Incorrect', null, 'A weighting factor for how the item score is used to compute a sub-test score when the item is attempted and incorrect. Item weight should be a negative value if the item subtracts from the score if missed.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12014', '7', 12014 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001013', 'Assessment Form Subtest Item Weight Not Attempted', null, 'A weighting factor for how the item score is used to compute a sub-test score when the item has not been attempted by the student. Item weight should be a negative value if the item subtracts from the score if not attempted.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12015', '7', 12015 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001014', 'Assessment Subtest Identifier Type', null, 'The type of identifier that is provided for a Subtest.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12016', '7', 12016 ); 
