INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001089', 'Assessment Language', null, 'The language in which the assessment form is designed to be delivered.', null, TRUE, 'The CEDS ISO 639-2 Language Code option set comes from the &lt;a href=http://www.loc.gov/standards/iso639-2/langhome.html&gt;ISO 639-2 standard&lt;/a&gt;, the character encoding in ISO 8859-1 download.  Discontinued codes from the ISO standard are not included in the CEDS list.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12073', '7', 12073 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001091', 'Assessment Subtest Published Date', null, 'The date on which the Subtest was published.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12075', '7', 12075 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001092', 'Assessment Result Descriptive Feedback Source', null, 'Identifies the source of the descriptive feedback that was given to a learner based on a scored/evaluated portion of an assessment. May indicate if this is teacher, scorer, or system generated feedback. Values for this attribute would be determined by the assessment program.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12076', '7', 12076 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001093', 'Assessment Session Special Event Description', null, 'Describes special events that occur before during or after the assessment session that may impact use of results according to rules related to the Assessment Registration Testing Indicator.', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12077', '7', 12077 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001094', 'Competency Framework Item Parent URL', 'Learning Standard Item Parent URL', 'A network-resolvable Uniform Resource Locator (URL) pointing to the authoritative reference for the hierarchal parent of the competency framework item.', 'Alphanumeric - 512 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12078', '7', 12078 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001102', 'Assessment Item Body Custom Interaction XML', null, 'The custom interaction provides an opportunity for extensibility of this specification to include support for interactions not currently documented.  The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12079', '7', 12079 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001103', 'Assessment Item Body Drawing Interaction XML', null, 'The drawing interaction allows the candidate to use a common set of drawing tools to modify a given graphical image (the canvas). It must be bound to a response variable with base-type file and single cardinality. The result is a file in the same format as the original image. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12080', '7', 12080 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001104', 'Assessment Item Body Gap Match Interaction XML', null, 'A gap match interaction contains a number gaps that the candidate can fill from an associated set of choices. The candidate must be able to review the content with the gaps filled in context, as indicated by their choices. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12081', '7', 12081 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001105', 'Assessment Item Body Match Interaction XML', null, 'A match interaction presents candidates with two sets of choices and allows them to create associates between pairs of choices in the two sets, but not between pairs of choices in the same set. Further restrictions can still be placed on the allowable associations using the match_Max attribute of the choices. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12082', '7', 12082 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001106', 'Assessment Item Body Graphic Gap Match Interaction XML', null, 'A graphic gap-match interaction is a graphical interaction with a set of gaps that are defined as areas (hotspots) of the graphic image and an additional set of gap choices that are defined outside the image. The candidate must associate the gap choices with the gaps in the image and be able to review the image with the gaps filled in context, as indicated by their choices. Care should be taken when designing these interactions to ensure that the gaps in the image are a suitable size to receive the required gap choices. It must be clear to the candidate which hotspot each choice has been associated with. When associated, choices must appear wholly inside the gaps if at all possible and, where overlaps are required, should not hide each other completely. If the candidate indicates the association by positioning the choice over the gap (e.g., drag and drop) the system should ''snap'' it to the nearest position that satisfies these requirements. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12083', '7', 12083 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001107', 'Assessment Item Body Hot Spot Interaction XML', null, 'A hotspot interaction is a graphical interaction with a corresponding set of choices that are defined as areas of the graphic image. The candidate''s task is to select one or more of the areas (hotspots). The hotspot interaction should only be used when the spatial relationship of the choices with respect to each other (as represented by the graphic image) is important to the needs of the item. Otherwise, choice_Interaction should be used instead with separate material for each option. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12084', '7', 12084 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001108', 'Assessment Item Body Graphic Order Interaction XML', null, 'A graphic order interaction is a graphic interaction with a corresponding set of choices that are defined as areas of the graphic image. The candidate''s task is to impose an ordering on the areas (hotspots). The order hotspot interaction should only be used when the spatial relationship of the choices with respect to each other (as represented by the graphic image) is important to the needs of the item. Otherwise, order_Interaction should be used instead with separate material for each option. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12085', '7', 12085 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001109', 'Assessment Item Body Select Point Interaction XML', null, 'Like hotspot_Interaction, a select point interaction is a graphic interaction. The candidate''s task is to select one or more points. The associated response may have an area_Mapping that scores the response on the basis of comparing it against predefined areas but the delivery engine must not indicate these areas of the image. Only the actual point(s) selected by the candidate shall be indicated. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12087', '7', 12087 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001110', 'Assessment Item Body Select Point Interaction', null, 'A graphic associate interaction is a graphic interaction with a corresponding set of choices that are defined as areas of the graphic image. The candidate''s task is to associate the areas (hotspots) with each other. The graphic associate interaction should only be used when the graphical relationship of the choices with respect to each other (as represented by the graphic image) is important to the needs of the item. Otherwise, associate_Interaction should be used instead with separate Material for each option. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12088', '7', 12088 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001111', 'Assessment Item Body Slider Interaction XML', null, 'The slider interaction presents the candidate with a control for selecting a numerical value between a lower and upper bound. It must be bound to a response variable with single cardinality with a base-type of either integer or float. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12089', '7', 12089 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001112', 'Assessment Item Body Choice Interaction XML', null, 'The choice interaction presents a set of choices to the candidate. The candidate''s task is to select one or more of the choices, up to a maximum of max_Choices. The interaction is always initialized with no choices selected. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12090', '7', 12090 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001114', 'Assessment Item Body Inline Choice Interaction XML', null, 'A inline choice is an inline interaction that presents the user with a set of choices, each of which is a simple piece of text. The candidate''s task is to select one of the choices. Unlike the Choice Interaction, the delivery engine must allow the candidate to review their choice within the context of the surrounding text.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12091', '7', 12091 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001115', 'Assessment Item Body Media Interaction XML', null, 'The media interaction allows more control over the way the candidate interacts with a time-based media object and allows the number of times the media object was experienced to be reported in the value of the associated response variable, which must be of base-type integer and single cardinality. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12092', '7', 12092 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001116', 'Assessment Item Body Hottext Interaction XML', null, 'The hottext interaction presents a set of choices to the candidate represented as selectable runs of text embedded within a surrounding context, such as a simple passage of text. Like choice_Interaction, the candidate''s task is to select one or more of the choices, up to a maximum of max_Choices. The interaction is initialized from the default_Value of the associated response variable, a NULL value indicating that no choices are selected (the usual case). The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12093', '7', 12093 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001117', 'Assessment Item Body Order Interaction XML', null, 'In an order interaction the candidate''s task is to reorder the choices, the order in which the choices are displayed initially is significant. By default the candidate''s task is to order all of the choices but a subset of the choices can be requested using the max_Choices and min_Choices attributes. When specified the candidate must select a subset of the choices and impose an ordering on them. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12094', '7', 12094 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001118', 'Assessment Item Body Position Object Interaction XML', null, 'The position object interaction consists of a single image which must be positioned on another graphic image (the stage) by the candidate. Like select_Point_Interaction, the associated response may have an area_Mapping that scores the response on the basis of comparing it against predefined areas but the delivery engine must not indicate these areas of the stage. Only the actual position(s) selected by the candidate shall be indicated. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12095', '7', 12095 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001119', 'Assessment Item Body Text Entry Interaction XML', null, 'A text_Entry interaction obtains a simple piece of text from the candidate. Like inline_Choice_Interaction, the delivery engine must allow the candidate to review their choice within the context of the surrounding text. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12096', '7', 12096 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001120', 'Assessment Item Body Extended Text Interaction XML', null, 'An extended text interaction allows the candidate to enter an extended amount of text. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12097', '7', 12097 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001121', 'Assessment Item Body End Attempt Interaction XML', null, 'The end attempt interaction is a special type of interaction which allows item authors to provide the candidate with control over the way in which the candidate terminates an attempt. The candidate can use the interaction to terminate the attempt (triggering response processing) immediately, typically to request a hint. It must be bound to a response variable with base-type boolean and single cardinality. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12098', '7', 12098 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001222', 'Assessment Item Body Upload Interaction XML', null, 'The upload interaction allows the candidate to upload a pre-prepared file representing their response. It must be bound to a response variable with base-type file and single cardinality. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12099', '7', 12099 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001123', 'Assessment Item Body Associate Interaction XML', null, 'An associate interaction presents candidates with a number of choices and allows them to create associations between them. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12100', '7', 12100 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001127', 'Assessment Need Type', null, 'A type of need identified for a learner as part of an assessment need profile.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12101', '7', 12101 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001130', 'Assessment Participant Session Security Issue', null, 'Describes an issue related to the security of a testing instrument identified during a specific instance of delivering an assessment to a specific person during a specific time period.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12102', '7', 12102 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001131', 'Assessment Item APIP Response Processing Template URL', null, 'These templates are described using the processing language defined in IMS Global APIP specification and are distributed (in XML form) along with it. Delivery engines that support generalized response processing do not need to implement special mechanisms to support them as a template file can be parsed directly while processing the assessment item that refers to it. This element provides the URL for the template.', 'Alphanumeric - 512 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12103', '7', 12103 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001132', 'Assessment Item APIP Response Processing XML', null, 'Response processing is the process by which the Delivery Engine assigns outcomes based on the learner''s responses. The outcomes may be used to provide feedback to the learner Feedback is either provided immediately following the end of the learner''s attempt or it is provided at some later time, perhaps as part of a summary report on the item session. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12104', '7', 12104 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001133', 'Assessment Item APIP Response Declaration XML', null, 'Response declarations state what the response variables include.  The response declaration may assign an optional correct response. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12105', '7', 12105 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001134', 'Assessment Item APIP Outcome Declaration XML', null, 'Outcome variables are declared by outcome declarations. Their value is set either from a default given in the declaration itself or by a response_Rule during response processing.  The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12106', '7', 12106 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001135', 'Assessment Item APIP Template Declaration XML', null, 'Template declarations declare item variables that are to be used specifically for the purposes of cloning items. They can have their value set only during template processing. They are referred to within the item body in order to individualize the clone and possibly also within the response Processing rules if the cloning process affects the way the item is scored.  The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12107', '7', 12107 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001136', 'Assessment Item APIP Template Processing XML', null, 'Template processing consists of one or more template rules that are followed by the cloning engine or delivery system in order to assign values to the template variables. Template processing is identical in form to response_Processing except that the purpose is to assign values to template variables, not outcome variables. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12108', '7', 12108 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001137', 'Assessment Item APIP Modal Feedback XML', null, 'Modal feedback is shown to the candidate directly following response processing. The value of an outcome variable is used in conjunction with the show_Hide and identifier attributes to determine whether or not the feedback is shown in a similar way to feedback_Element. The XML from the IMS Global APIP Specification would be included.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12109', '7', 12109 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001138', 'Assessment Item APIP Item Body XML', null, 'The item body contains the text, graphics, media objects, and interactions that describe the item''s content and information about how it is structured. The body is presented by combining it with stylesheet information, either explicitly or implicitly using the default style rules of the delivery or authoring system. This element contains the appropriate XML from the IMS Global APIP Specification defining the various item body interactions.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12110', '7', 12110 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001139', 'Assessment Item Adaptive Indicator', null, 'This indicator determines whether an assessment item is an adaptive item.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12111', '7', 12111 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001152', 'Assessment Participant Session Platform User Agent', null, ' A list of product tokens (keywords) with optional comments that identifies the client hardware and software with which the assessment was delivered to the student during the assessment session.', 'Alphanumeric - 512 characters maximum', FALSE, 'Implementation Note: The recommended approach is to store the User-Agent string returned as part of an HTTP header.  For example, an assessment session delivery via i_Pad might have mozilla/5.0 (i_pad; u; cpu os 3_2_1 like mac os x; en-us) apple_web_kit/531.21.10 (khtml, like gecko) mobile/7_b405', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12112', '7', 12112 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001153', 'Credential Criteria URL', null, 'The Uniform Resource Locator (URL) for the unique address of a web page describing the competency-based completion criteria for the achievement/award.', 'Alphanumeric - 512 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12113', '7', 12113 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001154', 'Competency Framework Item Text Complexity Minimum Value', 'Learning Standard Item Text Complexity Minimum Value', 'The minimum value in the range of text complexity applicable to a language competency framework item using the scaling system defined by Text Complexity System, e.g. Lexile(tm).', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12114', '7', 12114 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001155', 'Competency Framework Item Text Complexity Maximum Value', 'Learning Standard Item Text Complexity Maximum Value', 'The maximum value in the range of text complexity applicable to a language competency framework item using the scaling system defined by Text Complexity System, e.g. Lexile(tm).', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12115', '7', 12115 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001157', 'Accommodation Other Description', null, 'The description of the accommodation when ''Accommodation Type'' is set to ''Other''..', 'Alphanumeric - 30 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12116', '7', 12116 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001158', 'Assessment Item Interaction Type', null, 'The assessment item body interaction type as defined by IMS Global specifications.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12117', '7', 12117 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001162', 'Assessment Registration Test Attempt Identifier', null, 'A unique identifier for the test attempt assigned by the delivery system.', 'Alphanumeric - 40 characters maximum', FALSE, 'For paper-based tests this is typically a batch/stack/serial number and for online tests it is likely a unique internal identifier. Used to locate the original attempt.&lt;br/&gt;&lt;br/&gt;CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12119', '7', 12119 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001163', 'Credential Start Date', null, 'The date on which the achievement was conferred.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12120', '7', 12120 ); 
