INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001228', 'Status End Date', null, 'The last year, month and day when a status applied to an individual.', 'YYYY-MM-DD', FALSE, 'This element reflects the end date for a person?s status rather than that person?s participation in a program. Use Program Participation Exit Date if referring to a person?s participation in a program or receipt of services. Status dates and program participation dates don?t need to align, they are for different purposes. For example, for a homeless student the Status Begin Date and Status End Date elements are used to record when the student began being homeless to the date when the student ceased being homeless.  The student may begin receiving services under a program for homeless students after becoming homeless and that program may continue to provide services after the student ceases to have the status of ?homeless? and therefore have a Program Participation Start Date and Program Participation Exit Date that are different from the status dates.  Students under the Mc_Kinney-Vento may continue to receive services until the end of a school year even if they become stably housed at some point during the year.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12193', '7', 12193 ); 
