INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001250', 'Competency Framework Item Version', 'Learning Standard Item Version', 'A label assigned by the publisher indicating the version of the competency framework statement.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12216', '7', 12216 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001251', 'Assessment Item Response Theory Parameter A', null, 'The Item Response Theory value representing the discrimination of the item. The a parameter is found by taking the slope of the line tangent to the item characteristic curve at the inflection point, B. The parameter is the steepness of the curve at its steepest point.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12217', '7', 12217 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001252', 'Assessment Item Response Theory Parameter B', null, 'The Item Response Theory value representing the difficulty of the item.   It is the Theta value for the location of the inflection point of the item characteristic curve.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12218', '7', 12218 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001253', 'Assessment Item Response Theory Parameter Difficulty Category', null, 'A category for the difficulty of the item based on the Item Response Theory value.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12219', '7', 12219 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001254', 'Assessment Item Response Theory Parameter C', null, 'The Item Response Theory value for multiple choice items representing the guessing of the item. The c parameter is a lower asymptote. It is the low point of the curve as it moves to negative infinity on the horizontal axis. You can think of c as the probability that a chicken would get the item right.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12220', '7', 12220 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001255', 'Assessment Item Response Theory Parameter D1', null, 'For   polytomous assessment items with more than two possible responses, this is the item response theory value representing the threshold between the first and second item characteristic functions.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12221', '7', 12221 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001256', 'Assessment Item Response Theory Parameter D2', null, 'For   polytomous assessment items with more than two possible responses, this is the item response theory value representing the threshold between the second and third item characteristic functions.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12222', '7', 12222 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001257', 'Assessment Item Response Theory Parameter D3', null, 'For   polytomous assessment items with more than three possible responses, this is the item response theory value representing the threshold between the third and fourth item characteristic functions.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12223', '7', 12223 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001258', 'Assessment Item Response Theory Parameter D4', null, 'For   polytomous assessment items with more than four possible responses, this is the item response theory value representing the threshold between the fourth and fifth item characteristic functions.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12224', '7', 12224 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001259', 'Assessment Item Response Theory Parameter D5', null, 'For   polytomous assessment items with more than five possible responses, this is the item response theory value representing the threshold between the fifth and sixth item characteristic functions.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12225', '7', 12225 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001260', 'Assessment Item Response Theory Parameter D6', null, 'For   polytomous assessment items with more than six possible responses, this is the item response theory value representing the threshold between the sixth and seventh item characteristic functions.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12226', '7', 12226 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001261', 'Assessment Item Linking Item Indicator', null, 'Indicates that the item is intended to be administered in two different grades for the goal of establishing cross grade comparison.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12227', '7', 12227 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001262', 'Assessment Item Response Theory Point Biserial Correlation Value', null, 'The correlation between correct answers on this item and total correct answers on the test during a previous administration.?', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12228', '7', 12228 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001263', 'Assessment Item Release Status', null, 'Indicates that the assessment item has been released to the public.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12229', '7', 12229 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001264', 'Assessment Item Response Theory DIF Value', null, 'A value representing the Differential Item Functioning, also referred to as  measurement bias, for the assessment item.  The value represents differences in the functioning of the item across groups which are matched on the attribute being measure by the item.  The value is calculated using Mantel-Haenszel approach or a comparable algorithm so that a value of 1.0 represents no bias.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12230', '7', 12230 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001265', 'Assessment Item Response Theory Kappa Value', null, 'The measure used to represent the degree of agreement among raters.', 'Numeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12231', '7', 12231 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001266', 'Assessment Item Response Theory Kappa Algorithm', null, 'The algorithm used to derive the Assessment Item Kappa Value', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12232', '7', 12232 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001267', 'Assessment Item Body Text', null, 'The complete text of an assessment item including all applicable parts such as stimulus, stem, and possible response options presented.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12233', '7', 12233 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001268', 'Assessment Item Stimulus', null, ' The text, source (e.g., video clip), and/or graphic about which the assessment item is written. The stimulus provides the context of the item/task to which the student must respond.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12234', '7', 12234 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001269', 'Assessment Item Possible Response Option', null, 'The possible response presented to the participant within a selected-response/multiple-choice assessment item.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12235', '7', 12235 ); 
