INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001278', 'Advanced Placement Course Code', 'AP Course Code', 'Course areas for advanced placement or credit.  For a list of codes see http://apcentral.collegeboard.com/apc/public/courses/teachers_corner/index.html .', 'Alphanumeric - 60 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12244', '7', 12244 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001279', 'Professional Development Activity Education Levels Addressed', null, 'An age group or education level to which the professional development activity''s content pertains.', null, TRUE, 'Multiple options may be selected.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12245', '7', 12245 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001280', 'Agency Course Identifier', null, 'The course identifier as it may be recorded at the regional or state level to conform to a standardized course classification system.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12246', '7', 12246 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001281', 'Allergy Reaction Description', null, 'Describes symptoms know to be associated with a person''s reaction to an allergen.', 'Alphanumeric', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12247', '7', 12247 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001282', 'Allergy Severity', null, 'The level of severity of a person''s reaction to an allergen.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12248', '7', 12248 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001283', 'Allergy Type', null, 'Type of allergy condition attributed to a person as defined by the SNOWMED Clinical Terms(r) vocabulary.', null, TRUE, 'This material includes SNOMED Clinical Terms? (SNOMED CT?) which is used by permission of the International Health Terminology Standards Development Organisation (IHTSDO). All rights reserved. SNOMED CT?, was originally created by The College of American Pathologists. ?SNOMED? and ?SNOMED CT? are registered trademarks of the IHTSDO.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12249', '7', 12249 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001284', 'Assessment Item Result XML', null, 'The  assessment item result formatted according to the IMS Global QTI  Specification.', 'Alphanumeric', FALSE, 'See http://www.imsglobal.org/question/qtiv2p1/imsqti_resultv2p1.html#element10818', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12250', '7', 12250 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001287', 'Blended Learning Model Type', null, 'A type of formal education program in which a student learns at least in part through online learning, with some element of student control over time, place, path, and/or pace; at least in part in a supervised brick-and-mortar location away from home; and the modalities along each student?s learning path within a course or subject are connected to provide an integrated learning experience.', null, TRUE, 'This may be an attribute of a Course (as designed) or a Class Section (as delivered). It also may be attributed to a school, institution, or program for whole-school blended models.&lt;BR/&gt;&lt;BR/&gt;_Options and definition adapted from: http://www.christenseninstitute.org/blended-learning-model-definitions/', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12253', '7', 12253 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001288', 'Career Cluster', null, 'The career cluster that defines the industry or occupational focus which may be associated with a career pathways program, plan of study, or course.', null, TRUE, 'Options from O*NET On_Line an application that was created for the general public to provide broad access to the O*NET database of occupational information. O*NET On_Line offers a variety of search options and occupational data, while My Next Move is a streamlined application for students and job seekers. Both applications were developed for the U.S. Department of Labor by the National Center for O*NET Development.  See onetonline.org for more information.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12254', '7', 12254 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001289', 'Career Education Plan Date', null, 'The date on which an individual''s professional development career plan was last updated.', 'YYYY-MM-DD', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12255', '7', 12255 ); 
