INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001298', 'Course Academic Grade Scale Code', null, 'The grading scale used by an academic educational institution for an academic course.', 'Integer - 2 digits with leading zeros', FALSE, 'Based on the American Medical Colleges Admissions Services (AMCAS) grade scale, values 01 through 99. See Appendix E of the PESC XML High School Transcript Implementation Guide for a complete list of code values. 3-digit values (500 and above) established in earlier versions of the standard for miscellaneous grades are deprecated.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12264', '7', 12264 ); 
