INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001342', 'Employed Prior to Enrollment', null, 'An individual who is a paid employee or works in his or her own business, profession, or farm, as reported through the State Unemployment Insurance Wage Report, FEDES, or WRIS, before enrolling in secondary, postsecondary, or adult education or workforce programs.', null, TRUE, 'Individual-level data obtained by matching records with wage records, FEDES, or WRIS. The State Education Agency defines the time period for this collection around an exit period and a corresponding period for employment and earnings data to be obtained. The option set includes yes for employment found via one of the resources listed in the source element. These sources won''t tell you anything further about employment or unemployment, only that a record was not found or not matched thus ?unknown."', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12309', '7', 12309 ); 
