INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001346', 'Financial Account Description', null, 'The description for the financial account in an educational institution?s accounting system.', 'Alphanumeric - 300 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12313', '7', 12313 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001347', 'Financial Account K12 Fund Classification', null, 'A fund is a separate fiscal and accounting entity with a self-balancing set of accounts recording cash and other financial resources, together with all related liabilities and residual equities or balances or changes therein.', null, TRUE, 'Based on codes specified in the NCES Handbook &lt;a href=http://nces.ed.gov/pubs2015/fin_acct/chapter6_1.asp&gt;financial accounting for local and state school systems: 2014 edition&lt;/a&gt;.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12314', '7', 12314 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001348', 'Financial Account Name', null, 'The name given to the financial account in an educational institution?s accounting system.', 'Alphanumeric - 100 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12315', '7', 12315 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001349', 'Financial Account K12 Program Code', null, 'A program is a plan of activities and procedures designed to accomplish a predetermined objective or set of objectives.  The program classification provides the school district with a framework to classify instructional and other expenditures by program to determine cost.', null, TRUE, 'Based on codes specified in the NCES Handbook &lt;a href=http://nces.ed.gov/pubs2015/fin_acct/chapter6_2.asp&gt;financial accounting for local and state school systems: 2014 edition&lt;/a&gt;.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12316', '7', 12316 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001350', 'Financial Accounting Period Actual Value', null, 'The actual value of a financial account for the specified accounting period or fiscal year.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12317', '7', 12317 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001351', 'Financial Accounting Period Budgeted Value', null, 'The budgeted value of a financial account for the specified accounting period or fiscal year.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12318', '7', 12318 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001352', 'Financial Aid Income Level', null, 'The income level of an individual that is used by an institution''s financial aid office to determine an individual''s Expected Family Contribution (EFC).  For dependent students this will include the parents'' adjusted gross income and the student''s adjusted gross income.  For independent students this will include the student''s adjusted gross income.', 'Numeric - up to 2 digits after decimal place', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12319', '7', 12319 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001353', 'Financial Account K12 Balance Sheet Code', null, 'Balance sheet accounts and statement of net position accounts are used to track financial transactions for each fund. Such financial statements only report assets, deferred outflows of resources, liabilities, deferred inflows of resources, and equity accounts and are considered snapshots of how these accounts stand as of a certain point in time.', null, TRUE, 'Based on codes specified in the NCES Handbook &lt;a href=http://nces.ed.gov/pubs2015/fin_acct/chapter6_3.asp&gt;financial accounting for local and state school systems: 2014 edition&lt;/a&gt;.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12320', '7', 12320 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001354', 'Financial Expenditure K12 Function Code', null, 'The function describes the activity for which a service or material object is acquired. The functions of a school district are classified into five broad areas: instruction, support services, operation of noninstructional services, facilities acquisition and construction, and debt service. Functions are further classified into sub functions.', null, TRUE, 'Based on codes specified in the NCES Handbook &lt;a href=http://nces.ed.gov/pubs2015/fin_acct/chapter6_5.asp&gt;financial accounting for local and state school systems: 2014 edition&lt;/a&gt;.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12321', '7', 12321 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001355', 'Financial Expenditure K12 Object Code', null, 'This classification is used to describe the service or commodity obtained as the result of a specific expenditure.  Nine major object categories have codes ending in 00 and are further subdivided.', null, TRUE, 'Based on codes specified in the NCES Handbook &lt;a href=http://nces.ed.gov/pubs2015/fin_acct/chapter6_6.asp&gt;financial accounting for local and state school systems: 2014 edition&lt;/a&gt;.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12322', '7', 12322 ); 
