INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001370', 'Incident Perpetrator Identifier', null, 'Identifies the perpetrator of the incident by use of a pre-existing unique identifier assigned to a student or staff member by a school or district.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12338', '7', 12338 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001371', 'Incident Perpetrator Injury Type', null, 'An indication of the occurrence of physical injury to the perpetrator(s) (participants) involved in the incident and? if so? the level of injury sustained.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12339', '7', 12339 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001372', 'Incident Perpetrator Type', null, 'Information on the type of individual who committed an incident. A ?perpetrator? is an individual involved in an incident as an offender (the person who committed the infraction constituting the incident).', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12340', '7', 12340 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001373', 'Incident Person Role Type', null, 'The role or type of participation of a person in a discipline incident.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12341', '7', 12341 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001374', 'Incident Regulation Violated Description', null, 'A description of the rule? regulation? or standard that was violated when an incident occurred (e.g.? the identification of a relevant law? conduct standard? or acceptable use policy).', 'Alphanumeric - 100 characters maximum', FALSE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12342', '7', 12342 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001375', 'Incident Related to Disability Manifestation', null, 'An indication whether a student?s behavior (offense) was a manifestation of? or related to? a disability condition.', null, TRUE, 'Under IDEA ?300.530(e), a manifestation determination must occur within 10 days of any decision to change the child?s placement because of a violation of a code of student conduct.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12343', '7', 12343 ); 
