INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001377', 'Incident Victim Identifier', null, 'Identifies the victim of the incident by use of a pre-existing unique identifier assigned to a student or staff member by a school or district.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12346', '7', 12346 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001378', 'Incident Victim Type', null, 'Information on the type of individual who was injured or otherwise harmed as a direct result of the incident. A ?victim? is the individual who suffers injury or harm that directly results from the incident.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12347', '7', 12347 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001379', 'Incident Witness Identifier', null, 'Identifies the witness of the incident by use of a pre-existing unique identifier assigned to a student or staff member by a school or district. Using this data element permits linkage to descriptive information about the individual in the student or staff database.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12348', '7', 12348 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001380', 'Incident Witness Type', null, 'Information on the type of individual who witnessed the incident and can give a firsthand account of an incident that was seen? heard? or experienced.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12349', '7', 12349 ); 
