INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001412', 'Military Enlistment After Exit', null, 'An individual who is a member of the uniformed armed forces of the United States as reported through FEDES after exiting secondary, postsecondary, or adult education or workforce programs.', null, TRUE, 'Information on military enlistment is collected as a part of the FEDES program which facilitates periodic matches with the Department of Defense Manpower Information Center.  While the unemployment insurance data cannot be used to indicate that an individual is not employed, the DOD Enlistment data can suggest not enlisted when there is no match.  These data are included in FEDES matches and may need to be unduplicated from employment counts.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12381', '7', 12381 ); 
