INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001517', 'School Courses for the Exchange of Data Course Code', 'SCED Course Code', 'The five-digit SCED code. The first two-digits of the code represent the Course Subject Area and the next three digits identify the course number. These identifiers are fairly general but provide enough specificity to identify the course''s topic and to distinguish it from other courses in that subject area.', null, TRUE, 'See http://www.nces.ed.gov/programs/handbook/elementinfo.asp?elementid=14106.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12490', '7', 12490 ); 
