INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001524', 'Competency Framework Item Previous Version Identifier', 'Learning Standard Item Previous Version Identifier', 'The unique identifier of the previous version of the Competency Framework Item if the statement was modified.', 'Alphanumeric - 40 characters maximum', FALSE, 'This element supports version histories at the statement level. If corrections have been made to individual items/statements that are not part of a new Learning Standard Document, the elements ''Learning Standard Item Previous Version Iddentifier'' and ''Learning Standard Item Current Version Idndicator'' provide a reference to historical versions of the current statement. In such uses the ''Learning Standard Item Code'' could be the same for multiple versions of a statement and Learning Standard Item URL could resolve to the most current version of the statement.&lt;br/&gt;&lt;br/&gt;&lt;BR/&gt;CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces.&lt;br/&gt;&lt;br/&gt;&lt;BR/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12498', '7', 12498 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001525', 'Competency Framework Item Current Version Indicator', 'Learning Standard Item Current Version Indicator', 'Indicates that this is the most current version of the Competency Framework Item.', null, TRUE, 'This element supports version histories at the statement level. If corrections have been made to individual items/statements that are not part of a new Learning Standard Document,  the elements ''Learning Standard Item Previous Version Iddentifier'' and ''Learning Standard Item Current Version Idndicator'' provide a reference to historical versions of the current statement. In such uses the ''Learning Standard Item Code'' could be the same for multiple versions of a statement and Learning Standard Item URL could resolve to the most current version of the statement.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12499', '7', 12499 ); 
