INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001532', 'Assessment Form Adaptive Indicator', null, 'Indicates that the assessment form was generated using an algorithm rather than a fixed form.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12507', '7', 12507 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001533', 'Assessment Form Algorithm Identifier', null, 'An identifier for algorithm used to generate a custom form for an adaptive test.', 'Alphanumeric - 40 characters maximum', FALSE, 'The algorithm is typically used to generate the entire assessment form, but there may be cases in which it is used to generate only one part (Assessment Form Section).&lt;br/&gt;&lt;br/&gt;CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt; An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12508', '7', 12508 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001534', 'Assessment Form Algorithm Version', null, 'The version of the algorithm used to generate a custom form for an adaptive test.', 'Alphanumeric - 40 characters maximum', FALSE, 'The algorithm is typically used to generate the entire assessment form, but there may be cases in which it is used to generate only one part (Assessment Form Section).', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12509', '7', 12509 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001535', 'Assessment Form GUID', null, 'The globally unique identifier of an Assessment Form.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS guid elements are defined as RFC 4122 compliant 32-character hexadecimal strings (36 characters with dashes). For example, 21_EC2020-3_AEA-1069-A2_DD-08002_B30309_D. &lt;br/&gt;&lt;br/&gt;_Values MAY be encoded using a hash function such as HMAC-MD5 or HMAC-SHA1, resulting in a string up to 40 characters.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12510', '7', 12510 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001536', 'Assessment Form Section Item Field Test Indicator', null, 'Indicates that the assessment item is being field tested on this form of the test, and is not to be included for scoring.', null, TRUE, null, 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12511', '7', 12511 ); 
