INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001540', 'Assessment Participant Session GUID', null, 'A globally unique identifier for an instance of a person taking an assessment.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS guid elements are defined as RFC 4122 compliant 32-character hexadecimal strings (36 characters with dashes). For example, 21_EC2020-3_AEA-1069-A2_DD-08002_B30309_D. &lt;br/&gt;&lt;br/&gt;_Values MAY be encoded using a hash function such as HMAC-MD5 or HMAC-SHA1, resulting in a string up to 40 characters.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12515', '7', 12515 ); 
