INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001543', 'Assessment Result Data Type', null, ' The data type of the assessment result score value.', null, TRUE, 'An Assessment Result in CEDS may apply to an entire assessment or one aspect of evaluation as defined in the related ?subtest? entity.  The Assessment Result entity is repeatable, so there could be multiple Assessment Result Score Values each using a different Assessment Result Data Type, and each of these score values may be associated with one or more Assessment Performance Level(s).', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12518', '7', 12518 ); 
