INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001555', 'Financial Expenditure K12 Level of Instruction Code', null, 'This classification permits expenditures to be segregated by instructional level.', null, TRUE, 'Based on codes specified in the NCES Handbook &lt;a href=http://nces.ed.gov/pubs2015/fin_acct/chapter6_8.asp&gt;financial accounting for local and state school systems: 2014 edition&lt;/a&gt;.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12531', '7', 12531 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001556', 'Financial Expenditure K12 Project Reporting Code', null, 'The project/reporting code permits school districts to accumulate expenditures to meet a variety of specialized reporting requirements at the local, state, and federal levels. It is a three-digit code with the format 00_X.   The first two digits identify the particular funding source, authority, or expenditure purpose for which a special record or report is required. The third digit is available to identify particular projects and the fiscal year of the appropriation within that funding source. Each classification is presented by a code range followed by a description.', 'Numeric', FALSE, 'Based on the following code conventions specified in the NCES Handbook &lt;a href=http://nces.ed.gov/pubs2015/fin_acct/chapter6_7.asp&gt;financial accounting for local and state school systems: 2014 edition&lt;/a&gt;:&lt;BR/&gt;&lt;BR/&gt;010 to 190 Local Projects. Expenditures that require specialized reporting and are funded from local sources. &lt;BR/&gt;&lt;BR/&gt;200 to 390 State Projects. Expenditures that require specialized reporting for categorically funded state programs.&lt;BR/&gt;&lt;BR/&gt;400 to 990 Federal Projects. Expenditures that require specialized reporting to the federal government directly or through the state.&lt;BR/&gt;&lt;BR/&gt;1000 Noncategorical. Expenditures that do not require specialized reporting.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12532', '7', 12532 ); 
INSERT INTO rs_ceds7_sc._CEDS_Elements( Global_ID, Element_Name, Alt_Name, Definition, Format, Has_Option_Set, Usage_Notes, URL, Version, Term_ID ) VALUES ( '001557', 'Learner Action Actor Identifier', null, ' A unique identifier for the person performing the learner action.  The identifier should be encrypted when integrating learning experience data across systems to secure the privacy of the learner.', 'Alphanumeric - 40 characters maximum', FALSE, 'CEDS identifier elements reflect the intent of the XSD:_Token format, i.e. a string in which carriage return, line feed, and tab characters have been removed as well as any internal sequences of two or more spaces and any leading or trailing spaces. &lt;br/&gt;&lt;br/&gt;_An Identifier MAY be a Universally Unique Identifier (UUID) / Globally Unique Identifier (GUID), i.e.128-bit unique identifiers generated according to the algorithms and encoding standards of RFC 4122.', 'https://ceds.ed.gov/CEDS_Element_Details.aspx?_Term_Id=12533', '7', 12533 ); 
