INSERT INTO rs_ceds7_sc.Ref_Alternate_Fund_Uses( Ref_Alternate_Fund_Uses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Administering assessments required by section 1111(b)', '01', 'Administering assessments required by section 1111(b)', null, 1.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Alternate_Fund_Uses( Ref_Alternate_Fund_Uses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Developing challenging State academic content and student academic achievement standards', '02', 'Developing challenging State academic content and student academic achievement standards and aligned assessments in academic subjects for which standards and assessments are not required by section 1111(b).', null, 2.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Alternate_Fund_Uses( Ref_Alternate_Fund_Uses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Developing or improving assessments of English language proficiency', '03', 'Developing or improving assessments of English language proficiency necessary to comply with section 1111(b)(7)', null, 3.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Alternate_Fund_Uses( Ref_Alternate_Fund_Uses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Ensuring the continued validity and reliability of State assessments', '04', 'Ensuring the continued validity and reliability of State assessments, and/or refining State assessments to ensure their continued alignment with the State''s academic content standards and to improve the alignment of curricula and instructional materials', null, 4.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Alternate_Fund_Uses( Ref_Alternate_Fund_Uses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Developing multiple measures to increase the reliability and validity of State assessment systems', '05', 'Developing multiple measures to increase the reliability and validity of State assessment systems', null, 5.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Alternate_Fund_Uses( Ref_Alternate_Fund_Uses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Strengthening the capacity of local educational agencies and schools', '06', 'Strengthening the capacity of local educational agencies and schools to provide all students the opportunity to increase educational achievement, including carrying out professional development activities aligned with State student academic achievement standards and assessments', null, 6.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Alternate_Fund_Uses( Ref_Alternate_Fund_Uses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Expanding range of accommodations to students with LEP and students with disabilities (IDEA)', '07', 'Expanding the range of accommodations available to students with limited English proficiency and students with disabilities (IDEA) to improve the rates of inclusion of such students, including professional development activities aligned with State academic achievement standards and assessments', null, 7.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Alternate_Fund_Uses( Ref_Alternate_Fund_Uses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Improving the dissemination of information on student achievement and school  performance', '08', 'Improving the dissemination of information on student achievement and school  performance to parents and the community, including the development of information and reporting systems designed to identify best educational practices based on  scientifically based research or to assist in linking records of student achievement, length of enrollment, and graduation over time', null, 8.00 ); 
