INSERT INTO rs_ceds7_sc.Ref_Blended_Learning_Model_Type( Ref_Blended_Learning_Model_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Rotation model', 'Rotation', 'A model in which within a given course or subject, students rotate between learning modalities, at least one of which is online learning. Other modalities might include activities such as small-group or full-class instruction, group projects, individual tutoring, and pencil-and-paper assignments.', null, 1.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Blended_Learning_Model_Type( Ref_Blended_Learning_Model_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Flex model', 'Flex_Model', 'A model in which online learning is the backbone of student learning, even if it directs students to offline activities at times. Students move on an individually customized, fluid schedule among learning modalities, and the teacher of record is on-site. The teacher-of-record or other adults provide face-to-face support on a flexible and adaptive as-needed basis through activities such as small-group instruction, group projects, and individual tutoring.', null, 3.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Blended_Learning_Model_Type( Ref_Blended_Learning_Model_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'A La Carte model', 'A_La_Carte', 'A model in which students take one or more courses entirely online with an online teacher of record and at the?same time continue to have brick-and-mortar educational experiences. Students may take the online courses either on the brick-and-mortar campus or off-site.?_This differs from full-time online learning and the Enriched Virtual?model because it is not a whole-school experience.', null, 5.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Blended_Learning_Model_Type( Ref_Blended_Learning_Model_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Enriched Virtual model', 'Enriched_Virtual', 'A whole-school experience in which within each course, students divide their time between attending a brick-and-mortar campus and learning remotely, off-site, using online delivery of content and instruction.', null, 7.00 ); 
