INSERT INTO rs_ceds7_sc.Ref_Child_Outcomes_Summary_Rating( Ref_Child_Outcomes_Summary_Rating_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Shows occasional age-appropriate functioning across settings and situations', '04', 'Child shows occasional age-appropriate functioning across settings and situations. More functioning is not age-appropriate than age-appropriate.', null, 8.00 ); 
