INSERT INTO rs_ceds7_sc.Ref_Child_Outcomes_Summary_Rating( Ref_Child_Outcomes_Summary_Rating_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Functioning generally is considered appropriate for age but there are some significant concerns', '06', 'Child?s functioning generally is considered appropriate for his or her age but there are some significant concerns about the child?s functioning in this outcome area. These concerns are substantial enough to suggest monitoring or possible additional support.', null, 12.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Child_Outcomes_Summary_Rating( Ref_Child_Outcomes_Summary_Rating_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Shows functioning expected for age in all or almost all everyday situations', '07', 'Child shows functioning expected for his or her age in all or almost all everyday situations that are part of the child?s life. Functioning is considered appropriate for his or her age.', null, 14.00 ); 
