INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Accumulated depreciation', 'Accumulateddepreciation', 'Used for reporting all depreciation amounts, including depreciation on assets that may not be included elsewhere.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Assets: Amounts held by trustees for construction and debt service', 'Assets_Amountsheldbytrusteesfor', 'Includes cash and investments held by trustees in accordance with agreements that limit expenditure of those amounts to purchase of plant, property, or equipment or to payment of principal and interest on bonds and notes payable or other long-term debt.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Assets: Cash, cash equivalents, and temporary investments', 'Assets_Cashcashequivalentstemporaryinvestments', 'Cash equivalents are short term, highly liquid investments that are (1) readily converted to known amounts of cash, and (2) so near their maturity that they present insignificant risk of changes in value because of changes in interest rates. Examples are U.S. Treasury bills, certificates of deposit, bankers acceptances, repurchase agreements, and commercial paper. Includes amounts for currency on hand and deposits held by financial institutions that can be added to or withdrawn without limitation, such as demand deposits. (FARM para. 402)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Assets: Inventories, prepaid expenses, and deferred charges', 'Assets_Inventoriesprepaidexpensesdeferredcharges', 'Inventories, prepaid expenses, and deferred charges ? For inventories, include amounts for merchandise inventory held for resale, for example, items held for sale by a bookstore or a dining service. Include supplies and other inventoried items for internal use if recognized as an asset in the GPFS. For prepaid expenses and deferred charges, include amounts paid in advance of services received and expenses deferred because benefits relate to future rather than to current period activities. Examples include prepaid rent, prepaid insurance, bond issue costs, pension costs or other outflows applicable to future periods. (FARM para. 407)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Assets: Other assets', 'Assets_Otherassets', 'Includes all other assets not reported elsewhere.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Assets: Receivables (net of allowance for uncollectible amounts)', 'Assets_Receivablesnetofallowancefor', 'Includes amounts receivable for all purposes, including billings for educational and general programs and auxiliary enterprise activities; student loans receivable; government appropriations receivable; amounts receivable on grants and contracts; accrued dividends and interest receivable; claims against vendors; advances to employees; and reimbursements receivable from affiliated organizations. All amounts receivable should be reported net of an allowance for uncollectible accounts. (FARM para. 403)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Debt related to Property, Plant, and Equipment', 'Debtrelatedto_Property_Plant_Equipment', 'Includes amounts for all long-term debt obligations including bonds payable, mortgages payable, capital leases payable, and long-term notes payable. (FARM para. 420.3, 423) If the current portion of long-term debt is separately reported in the GPFS, include that amount.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Gross Property Plant Equipment: Buildings', 'Gross_Property_Plant_Equipment_Buildings', 'Used for reporting end of year values for buildings as a reconciliation of beginning of the year values with additions to and retirements of building values to obtain end of year values. Capitalized leasehold improvements should be included if the improvements are to leased facilities.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Gross Property Plant Equipment: Construction in Progress', 'Gross_Property_Plant_Equipment_Constructionin_Progress', 'Used for reporting capital assets under construction and not yet placed into service.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Gross Property Plant Equipment: Equipment, including art and library collections', 'Gross_Property_Plant_Equipment_Equipment', 'Used for reporting end of year values for equipment as a reconciliation of beginning of the year values with additions to and retirements of equipment values to obtain end of year values. Capitalized leasehold improvements should be included if the improvements are to leased equipment.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'Gross Property Plant Equipment: Land and land improvements', 'Gross_Property_Plant_Equipment_Landlandimprovements', 'Used for reporting end of year values for land and land improvements as a reconciliation of beginning of the year values with additions to and retirements of land and land improvements to obtain end of year values. Use your underlying institutional records.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 12, 'Gross Property Plant Equipment: Other', 'Gross_Property_Plant_Equipment_Other', 'Used for reporting all other amounts for capital assets not reported elsewhere.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 13, 'Intangible Assets, net of accumulated amortization', 'Intangible_Assetsnetofaccumulatedamortization', 'Used for reporting all assets consisting of certain nonmaterial rights and benefits of an institution, such as patents, copyrights, trademarks and goodwill. The amount reported should be reduced by total accumulated amortization. (FARM para. 409)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 14, 'Liabilities: Accounts payable', 'Liabilities_Accountspayable', 'Includes the total of accounts payable to suppliers. (FARM para. 420)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 15, 'Liabilities: Annuity and life income obligations and other amounts held for the benefit of others', 'Liabilities_Annuitylifeincomeobligationsother', 'Includes agency obligations, the beneficiaries? interests in assets held by the institution subject to split-interest agreements (i.e., the obligation, measured at present value of payments to be made), deferred compensation amounts, and similar obligations recognized in the GPFS.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 16, 'Liabilities: Bonds, notes, and capital leases payable and other long-term debt, including current po', 'Liabilities_Bondsnotescapitalleases', 'Includes amounts for all long-term debt obligations including bonds payable, mortgages payable, capital leases payable, and long-term notes payable. If the current portion of long-term debt is separately reported in your GPFS, include that amount. (FARM para. 420 and 423)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 17, 'Liabilities: Deferred revenues and refundable advances', 'Liabilities_Deferredrevenuesrefundableadvances', 'Includes short-term deferrals and advances including student deposits, advances from third parties for services not yet performed, short-term advances on grants or contracts (including those from the government), and refunds due third parties for amounts previously received. (FARM para. 422)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 18, 'Liabilities: Government grants refundable under student loan programs', 'Liabilities_Governmentgrantsrefundableunder', 'Includes amounts advanced to the institution by a governmental entity for purposes of making loans to students (if recognized as a liability in the GPFS).', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 19, 'Liabilities: Other accrued liabilities', 'Liabilities_Otheraccruedliabilities', 'Includes amounts for any accrued liabilities, including accrued interest payable, salary and benefit (payroll) accruals, and similar accrued expenses not found in another category. (FARM para. 420)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 20, 'Liabilities: Other liabilities', 'Liabilities_Otherliabilities', 'Includes all other liabilities not reported elsewhere.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 21, 'Liabilities: Post-retirement and post-employment obligations', 'Liabilities_Postretirementpostemploymentobligations', 'Includes amounts for pension obligations, post-retirement healthcare benefit obligations, severance obligations, and similar post-retirement and post-employment obligations. (FARM para. 478 and 479)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 22, 'Long-term investments', 'Longterminvestments', 'Used for reporting the end-of-year market value for all assets held for long-term investment. Long-term investments should be distinguished from temporary investments based on the intention of the organization regarding the term of the investment rather than the nature of the investment itself. Thus, cash and cash equivalents which are held until appropriate long-term investments are identified should be treated as long-term investments. Similarly, cash equivalents strategically invested and reinvested for long-term purposes should be treated as long-term investments. (FARM para. 405)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 23, 'Permanently restricted net assets', 'Permanentlyrestrictednetassets', 'Used for reporting the portion of net assets required by the donor or grantor to be held in perpetuity. (FARM para 450.2)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 24, 'Property, Plant, and Equipment, net of accumulated depreciation', 'Property_Plant_Equipmentnetofaccumulateddepreciation', 'Includes end-of-year market value for categories such as land, buildings, improvements other than buildings, equipment, and library books, combined and net of accumulated depreciation. (FARM para. 415)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 25, 'Temporarily restricted net assets', 'Temporarilyrestrictednetassets', 'Used for reporting net assets that are subject to a donor?s or grantor?s restriction are restricted net assets. Include long-term but temporarily restricted net assets, such as term endowments, and net assets held subject to trust agreements if those agreements permit expenditure of the resources at a future date. (FARM para. 450.3)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Financial_Position( Ref_IPEDSFASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 26, 'Total unrestricted net assets', 'Totalunrestrictednetassets', 'Used for reporting the amount of unrestricted (designated and undesignated) net assets. Unrestricted net assets are amounts that are available for the general purposes of the institution without restriction. Include amounts specifically designated by the governing board, such as those designated as quasi-endowments, for building additions and replacement, for debt service, and for loan programs. In addition, include the unrestricted portion of net investment in plant, property, and equipment less related debt. This amount is computed as the amount of plant, property, and equipment, net of accumulated depreciation, reduced by any bonds, mortgages, notes, capital leases, or other borrowings that are clearly attributable to the acquisition, construction, or improvement of those assets. (FARM para. 450)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Pell_Grant_Transactions( Ref_IPEDSFASB_Pell_Grant_Transactions_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Does not award Pell grants', 'Doesnotaward_Pellgrants', null, null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Pell_Grant_Transactions( Ref_IPEDSFASB_Pell_Grant_Transactions_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Federal grant revenue', 'Federalgrantrevenue', 'Pell grants are counted as federal revenue and allowance to tuition and fees and/or auxiliary enterprises (for room and board, books, meals, etc.). There should be an offsetting discount/allowance to tuition and fees revenue and/or auxiliary enterprise revenue so that the Pell grants are not being double counted in the institution''s revenues.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Pell_Grant_Transactions( Ref_IPEDSFASB_Pell_Grant_Transactions_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Pass through', 'Passthrough', 'A pass-through transaction is essentially a payment on the student''s account where the institution is purely processing the Pell Grant and those monies are not counted by the institution until they come in as a tuition payment from the student. The latter option is sometimes referred to as an agency transaction. With this option Pell grants are not counted as federal revenues and are not considered to be a discount/allowance to tuition and fees or auxiliary enterprises.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Revenue_Restriction( Ref_IPEDSFASB_Revenue_Restriction_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Permanently Restricted', 'Permanently_Restricted', 'Used for reporting revenues that must be maintained in perpetuity due to a donor-imposed restriction.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Revenue_Restriction( Ref_IPEDSFASB_Revenue_Restriction_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Temporarily Restricted', 'Temporarily_Restricted', 'Used for reporting revenues that are subject to limitation by donor specification as to use or the time when use may occur (such as a later period of time or after specified events have occurred).', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSFASB_Revenue_Restriction( Ref_IPEDSFASB_Revenue_Restriction_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Unrestricted', 'Unrestricted', 'Used for reporting revenues that are not subject to limitations by a donor-imposed restriction.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Capital Assets: Accumulated depreciation', 'Capital_Assets_Accumulateddepreciation', 'Used for reporting all depreciation amounts, including depreciation on assets that may not be included in other capital assets categories.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Capital Assets: Buildings', 'Capital_Assets_Buildings', 'Used for reporting structures built for occupancy or use, such as for classrooms, research, administrative offices, storage, etc. Includes built-in fixtures and equipment that are essentially part of the permanent structure.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Capital Assets: Construction in progress', 'Capital_Assets_Constructioninprogress', 'Used for reporting capital assets under construction and not yet placed into service.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Capital Assets: Equipment, including art and library collections', 'Capital_Assets_Equipmentincludingartlibrary', 'Used for reporting moveable tangible property such as research equipment, vehicles, office equipment, library collections (capitalized amount of books, films, tapes, and other materials maintained in library collections intended for use by patrons), and capitalized art collections.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Capital Assets: Infrastructure', 'Capital_Assets_Infrastructure', 'Used for reporting infrastructure assets such as roads, bridges, drainage systems, water and sewer systems, etc.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Capital Assets: Intangible assets, net of accumulated amortization', 'Capital_Assets_Intangibleassetsnetof', 'Used for reporting all assets consisting of certain nonmaterial rights and benefits of an institution, such as patents, copyrights, trademarks and goodwill. The amount should be reduced by total accumulated amortization.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Capital Assets: Land and land improvements', 'Capital_Assets_Landlandimprovements', 'Used for reporting land and other land improvements, such as athletic fields, golf courses, lakes, etc.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Capital Assets: Other capital assets', 'Capital_Assets_Othercapitalassets', null, null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Deferred inflows of resources', 'Deferredinflowsofresources', 'Used for reporting the deferred inflows of resources as recognized in the institution?s GPFS and in accordance with GASB 63.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Deferred outflows of resources', 'Deferredoutflowsofresources', 'Used for reporting the deferred outflows of resources as recognized in the institution?s GPFS and in accordance with GASB 63.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'Depreciable capital assets, net of depreciation', 'Depreciablecapitalassetsnetofdepreciation', 'Used for reporting all capital assets reduced by the total accumulated depreciation, including improvements to land, easements, buildings, building improvements, vehicles, machinery, equipment, infrastructure, and all other tangible or intangible depreciable assets that are used in operations and that have initial useful lives extending beyond a single reporting period. Includes the net amount of all depreciable capital assets after reducing the gross amount for accumulated depreciation.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 12, 'Long-term debt', 'Longtermdebt', 'Used for reporting the amount for long-term debt arising from debt issuance and lease-purchase agreements.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 13, 'Long-term debt, current portion', 'Longtermdebtcurrentportion', 'Used for reporting the amount due in the next operating cycle (usually a year) for amounts otherwise reported as long-term or noncurrent debt. Includes only outstanding debt.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 14, 'Net assets invested in capital assets, net of related debt', 'Netassetsinvestedincapitalassetsnetofrelateddebt', 'Used for reporting the component of net assets represented by the total of all capital assets, reduced by accumulated depreciation, and reduced by the amount of outstanding bonds, mortgages, notes, or other borrowings that are attributable to the acquisition, construction, or improvement of those assets (see indebtedness on capital assets). Some outstanding debt may be reported in both current and noncurrent liabilities.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 15, 'Other current liabilities', 'Othercurrentliabilities', null, null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 16, 'Other noncurrent assets', 'Othernoncurrentassets', null, null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 17, 'Other non-current liabilities', 'Othernoncurrentliabilities', null, null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 18, 'Restricted expendable net assets', 'Restrictedexpendablenetassets', 'Used for reporting restricted net assets that are expendable. Net assets should be reported as restricted when constraints placed on use are either (a) externally imposed by creditors, grantors, contributors, or laws and regulations of other governments or (b) imposed by law through constitutional provisions or enabling legislation. Expendable net assets are all those not required to be retained in perpetuity.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 19, 'Restricted non-expendable net assets', 'Restrictednonexpendablenetassets', 'Used for reporting net assets that are restricted and nonexpendable. Net assets should be reported as restricted when constraints placed on use are either (a) externally imposed by creditors, grantors, contributors, or laws and regulations of other governments or (b) imposed by law through constitutional provisions or enabling legislation. Nonexpendable net assets are those that are required to be retained in perpetuity.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 20, 'Total current assets', 'Totalcurrentassets', 'Used for reporting all current assets, including cash and cash equivalents, investments, accounts and notes receivables (net of allowance for uncollectible amounts), inventories, and all other assets classified as current assets.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Financial_Position( Ref_IPEDSGASB_Financial_Position_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 21, 'Unrestricted net assets', 'Unrestrictednetassets', 'This should be the amount of net assets that do not meet the definition of ?restricted? or ?invested in capital assets, net of related debt.?', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Additions to permanent endowments', 'Additionstopermanentendowments', 'Used for reporting gifts and other additions to endowments that are permanently nonexpendable.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Capital appropriations', 'Capitalappropriations', 'Used for reporting amounts provided by government appropriations intended primarily for acquisition or construction of capital assets for the institution.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Capital grants and gifts', 'Capitalgrantsgifts', 'Used for reporting amounts received from gifts or grants primarily intended to provide for the acquisition or construction of capital assets for the institution.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Federal appropriations', 'Federalappropriations', 'Used for reporting all amounts received by the institution through acts of a federal legislative body, except grants and contracts. Funds reported in this category are for meeting current operating expenses, not for specific projects or programs. An example is federal land-grant appropriations. If your institution accounts for land grant appropriations as operating revenue, they are excluded from this amount. Does not include any ARRA revenues.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Federal nonoperating grants', 'Federalnonoperatinggrants', 'Used for reporting all amounts reported as nonoperating revenues from federal governmental agencies that are provided on a nonexchange basis. Includes Pell Grants and other Federal student grant aid. Does not include revenues from the Federal Direct Student Loan (FDSL) Program, Federal Work-Study or federal veteran education benefits. These amounts should be captured as tuition and fees and/or sales and services of auxiliary enterprise revenue upon receipt from the student. Does not include capital grants & gifts or any ARRA revenues.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Federal operating grants and contracts', 'Federaloperatinggrantscontracts', 'Used for reporting revenues from federal governmental agencies that are for specific research projects or other types of programs and that are classified as operating revenues. Examples are research projects and similar activities for which amounts are received or expenditures are reimbursable under the terms of a grant or contract. Includes federal land grant appropriations if considered operating revenue. Does not include Pell grants or other federal student aid. Does not include any ARRA revenues.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Gifts, including contributions from affiliated organizations', 'Giftsincludingcontributionsfromaffiliated', 'Used for reporting revenues from private donors for which no legal consideration is provided; these would be nonexchange transactions as defined in GASB Statement No. 33 Accounting and Financial Reporting for Nonexchange Transactions. Includes all gifts or contributions to the institution except those classified as additions to permanent endowments or capital grants & gifts. Includes gifts from affiliated organizations. Includes the amount of contributed services recognized by the institution. Does not include capital grants & gifts.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Independent operations', 'Independentoperations', 'Includes all operating revenues associated with operations independent of the primary missions of the institution. This category generally includes only those revenues associated with major federally funded research and development centers. Does not include the net profit (or loss) from operations owned and managed as investments of the institution?s endowment funds.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Investment income', 'Investmentincome', 'Used for reporting all investment income not reported elsewhere.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Local appropriations, education district taxes, and similar support', 'Localappropriationseducationdistrict', 'Used for reporting all amounts received from property or other taxes assessed directly by or for an institution below the state level. Include any other similar general support provided to the institution from governments below the state level, including local government appropriations.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'Local government nonoperating grants', 'Localgovernmentnonoperatinggrants', 'Used for reporting all amounts reported as nonoperating revenues from local governmental agencies and organizations that are provided on a nonexchange basis. Does not include capital grants & gifts.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 12, 'Local government operating grants and contracts', 'Localgovernmentoperatinggrantscontracts', 'Used for reporting revenues from local governmental agencies that are for specific research projects or other types of programs and that are classified as operating revenues. Examples are research projects and similar activities for which amounts are received or expenditures are reimbursable under the terms of a grant or contract.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 13, 'Other nonoperating revenues', 'Othernonoperatingrevenues', 'Used for reporting all other nonoperating revenues not reported elsewhere. For institutions that received American Recovery and Reinvestment Act (ARRA) revenues during the reporting period, allow inclusion of these amounts.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 14, 'Other operating revenue', 'Otheroperatingrevenue', 'Used for reporting all other sources not reported elsewhere.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 15, 'Other revenues and additions', 'Otherrevenuesadditions', 'Used for reporting all other revenues and additions not reported elsewhere.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 16, 'Private operating grants and contracts', 'Privateoperatinggrantscontracts', 'Used for reporting revenues from nongovernmental agencies and organizations that are for specific research projects or other types of programs and that are classified as operating revenues. Examples are research projects and similar activities for which amounts are received or expenditures are reimbursable under the terms of a grant or contract.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 17, 'Sales and services of auxiliary enterprises (net discounts and allowances)', 'Salesservicesofauxiliaryenterprisesnetofdiscounts', 'Used for reporting revenues (net of discounts & allowances) generated by auxiliary enterprises that exist to furnish a service to students, faculty, or staff, and that charge a fee that is directly related to the cost of the service. Examples are residence halls, food services, student health services, intercollegiate athletics, college unions, college stores, and movie theaters.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 18, 'Sales & services of educational activities', 'Salesservicesofeducationalactivities', 'Includes all operating revenues derived from the sales of goods or services that are incidental to the conduct of instruction, research or public service, and revenues of activities that exist to provide instructional and laboratory experience for students and that incidentally create goods and services that may be sold. Examples include film rentals, scientific and literary publications, testing services, university presses, dairies, and patient care clinics that are not part of a hospital.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 19, 'Sales and services of hospitals (after deducting patient contractual allowances)', 'Salesservicesofhospitalsafterdeducting', 'Includes operating revenues (net of patient contractual allowances) for a hospital operated by the institution and clinics associated with training. Excludes clinics that are part of the student health services program.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 20, 'State appropriations', 'Stateappropriations', 'Used for reporting all amounts received by the institution through acts of a state legislative body, except grants and contracts and amounts reportable as capital appropriations. Funds reported in this category are for meeting current operating expenses, not for specific projects or programs. Does not include any ARRA revenues.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 21, 'State nonoperating grants', 'Statenonoperatinggrants', 'Used for reporting all amounts reported as nonoperating revenues from state governmental agencies that are provided on a nonexchange basis. Does not include capital grants & gifts or any ARRA revenues.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 22, 'State operating grants and contracts', 'Stateoperatinggrantscontracts', 'Used for reporting revenues from state governmental agencies that are for specific research projects or other types of programs and that are classified as operating revenues. Examples are research projects and similar activities for which amounts are received or expenditures are reimbursable under the terms of a grant or contract. Does not include any ARRA revenues.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDSGASB_Revenue( Ref_IPEDSGASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 23, 'Tuition and fees (net discounts and allowances)', 'Tuitionfeesnetofdiscountsallowances', 'Used for reporting all tuition & fees (including student activity fees) revenue received from students for education purposes. Include revenues for tuition and fees net of discounts & allowances from institutional and governmental scholarships, waivers, etc. (report gross revenues minus discounts and allowances). Includes those tuition and fees that are remitted to the state as an offset to state appropriations. (Charges for room, board, and other services rendered by auxiliary enterprises are not reported here.)', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDS_Intercollegiate_Athletics_Expenses( Ref_IPEDS_Intercollegiate_Athletics_Expenses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Auxiliary enterprises', 'Auxiliaryenterprises', 'Expenses for essentially self-supporting operations of the institution that exist to furnish a service to students, faculty, or staff, and that charge a fee that is directly related to, although not necessarily equal to, the cost of the service. Examples are residence halls, food services, student health services, intercollegiate athletics (only if essentially self-supporting), college unions, college stores, faculty and staff parking, and faculty housing. Institutions include actual or allocated costs for operation and maintenance of plant, interest and depreciation.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDS_Intercollegiate_Athletics_Expenses( Ref_IPEDS_Intercollegiate_Athletics_Expenses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Does not participate in intercollegiate athletics', 'Doesnotparticipateinintercollegiateathletics', null, null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDS_Intercollegiate_Athletics_Expenses( Ref_IPEDS_Intercollegiate_Athletics_Expenses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Other', 'Other', null, null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPEDS_Intercollegiate_Athletics_Expenses( Ref_IPEDS_Intercollegiate_Athletics_Expenses_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Student services', 'Studentservices', 'A functional expense category that includes expenses for admissions, registrar activities, and activities whose primary purpose is to contribute to students emotional and physical well-being and to their intellectual, cultural, and social development outside the context of the formal instructional program. Examples include student activities, cultural events, student newspapers, intramural athletics, student organizations, supplemental instruction outside the normal administration, and student records. Intercollegiate athletics and student health services may also be included except when operated as self-supporting auxiliary enterprises. Also may include information technology expenses related to student service activities if the institution separately budgets and expenses information technology resources(otherwise these expenses are included in institutional support.) Institutions include actual or allocated costs for operation and maintenance of plant, interest, and depreciation.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPSP_Progress_Report_Schedule( Ref_IPSP_Progress_Report_Schedule_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Daily', 'Daily', 'Daily is the frequency by which parents are notified of the student?s progress on annual goals.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPSP_Progress_Report_Schedule( Ref_IPSP_Progress_Report_Schedule_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Monthly', 'Monthly', 'Monthly is the frequency by which parents are notified of the student?s progress on annual goals.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPSP_Progress_Report_Schedule( Ref_IPSP_Progress_Report_Schedule_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Other', 'Other', 'Other is specified as the frequency by which parents are notified of the student?s progress on annual goals.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPSP_Progress_Report_Schedule( Ref_IPSP_Progress_Report_Schedule_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Quarterly', 'Quarterly', 'Quarterly is the frequency by which parents are notified of the student?s progress on annual goals.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPSP_Progress_Report_Schedule( Ref_IPSP_Progress_Report_Schedule_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Term', 'Term', 'Term is the frequency by which parents are notified of the student?s progress on annual goals.', null, null ); 
INSERT INTO rs_ceds7_sc.Ref_IPSP_Progress_Report_Schedule( Ref_IPSP_Progress_Report_Schedule_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Weekly', 'Weekly', 'Weekly is the frequency by which parents are notified of the student?s progress on annual goals.', null, null ); 
